ifiedDate,classNameId,classPK,resourceClassNameId,templateKey,version,name,description,type_,mode_,[language],script,cacheable,smallImage,smallImageId,smallImageURL,lastPublishDate) VALUES
	 (1,0,N'79f9306c-e28f-fe25-44d6-511624a86fe6',37699,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:08',27705,0,37698,N'DOCUMENTLIBRARY-CAROUSEL-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Carousel</Name><Name language-id="ar_SA">مكتبة</Name><Name language-id="ca_ES">Carrussel</Name><Name language-id="zh_CN">Carousel</Name><Name language-id="nl_NL">Carrousel</Name><Name language-id="fi_FI">Karuselli</Name><Name language-id="fr_FR">Carrousel</Name><Name language-id="de_DE">Karussel</Name><Name language-id="hu_HU">Körhinta</Name><Name language-id="ja_JP">カルーセル</Name><Name language-id="pt_BR">Carrossel</Name><Name language-id="es_ES">Carrusel</Name><Name language-id="sv_SE">Carousel</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays images in a carousel.</Description><Description language-id="ar_SA">يعرض الصور في مكتبة.</Description><Description language-id="ca_ES">Mostra imatges en format carrusel.</Description><Description language-id="zh_CN">把图片显示在转盘中。</Description><Description language-id="nl_NL">Geeft afbeeldingen weer in een carrousel.</Description><Description language-id="fi_FI">Näyttää kuvat karusellissa.</Description><Description language-id="fr_FR">Affiche les images dans un carrousel.</Description><Description language-id="de_DE">Darstellung von Bildern in einem Karussell.</Description><Description language-id="hu_HU">Megjeleníti a képeket körhintaszerűen.</Description><Description language-id="ja_JP">カルーセル内に画像を表示</Description><Description language-id="pt_BR">Exibe imagens num carrossel.</Description><Description language-id="es_ES">Muestra imágenes en un carrusel.</Description><Description language-id="sv_SE">Visar bilder i carousel-format.</Description></root>',N'display',NULL,N'ftl',N'<#if entries?has_content>
	<style>
		#<@portlet.namespace />carousel .carousel-item {
			background-color: #000;
			height: 250px;
			overflow: hidden;
			text-align: center;
			width: 700px;
		}

		#<@portlet.namespace />carousel .carousel-item img {
			max-height: 250px;
			max-width: 700px;
		}
	</style>

	<div id="<@portlet.namespace />carousel">
		<#assign imageMimeTypes = propsUtil.getArray("dl.file.entry.preview.image.mime.types") />

		<#list entries as entry>
			<#if imageMimeTypes?seq_contains(entry.getMimeType())>
				<div class="carousel-item image-viewer-base-image">
					<img src="${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, "")}" />
				</div>
			</#if>
		</#list>
	</div>

	<@liferay_aui.script use="aui-carousel">
		var carousel = new A.Carousel(
			{
				after: {
					responsive: function(event) {
						event.stopImmediatePropagation();

						var boundingBox = event.currentTarget.get(''boundingBox'');

						boundingBox.all(''.image-viewer-base-image-list, .image-viewer-base-image'').setStyles(
							{
								height: ''auto'',
								maxHeight: event.height,
								maxWidth: event.width,
								width: ''auto''
							}
						);
					}
				},

				contentBox: ''#<@portlet.namespace />carousel'',
				height: 250,
				intervalTime: 2,
				width: 700
			}
		).render();
	</@liferay_aui.script>
</#if>',0,0,37700,NULL,NULL),
