	 (1,0,N'a3205562-bfee-7e71-6821-1ee6b80236fa',37732,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:05',20098,0,37698,N'NAV-PILLS-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Pills Horizontal</Name><Name language-id="ar_SA">أزرار أفقية</Name><Name language-id="ca_ES">Càpsules horitzontals</Name><Name language-id="zh_CN">Pills Horizontal</Name><Name language-id="nl_NL">Horizontale pillen</Name><Name language-id="fi_FI">Pills Vaakasuunta</Name><Name language-id="fr_FR">Pilules horizontales</Name><Name language-id="de_DE">Pills horizontal</Name><Name language-id="hu_HU">Vízszintes tabletták</Name><Name language-id="ja_JP">水平方向のピル形式</Name><Name language-id="pt_BR">Comprimidos horizontais</Name><Name language-id="es_ES">Globos horizontales</Name><Name language-id="sv_SE">Piller horisontellt</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays a navigation menu with navigation items shown as pills.</Description><Description language-id="ar_SA">يعرض قائمة تنقل بعناصر تنقل يتم عرضها في شكل أزرار.</Description><Description language-id="ca_ES">Mostra un menú de navegació amb elements de navegació que es mostren com a càpsules.</Description><Description language-id="zh_CN">显示导航菜单，其中导航项显示为药丸。</Description><Description language-id="nl_NL">Geeft een navigatiemenu weer met navigatie-items in de vorm van pillen.</Description><Description language-id="fi_FI">Näyttää navigointivalikon navigointikohteet pillereinä.</Description><Description language-id="fr_FR">Affiche un menu de navigation dont les éléments sont affichés sous la forme de pilules.</Description><Description language-id="de_DE">Zeigt ein Navigationsmenü mit Navigationselementen als Pills an.</Description><Description language-id="hu_HU">Megjelenít egy navigációs menüt tablettákként megjelenített navigációs elemekkel.</Description><Description language-id="ja_JP">ピル形式でナビゲーションメニューを表示します。</Description><Description language-id="pt_BR">Exibe um menu de navegação com itens de navegação exibidos como pills.</Description><Description language-id="es_ES">Muestra un menú de navegación con elementos de navegación que se muestran como globos.</Description><Description language-id="sv_SE">Visar en navigeringsmeny med navigeringsobjekt som visas som piller.</Description></root>',N'display',NULL,N'ftl',N'<#include "${templatesPath}/NAVIGATION-MACRO-FTL" />

<#if !entries?has_content>
	<#if themeDisplay.isSignedIn()>
		<div class="alert alert-info">
			<@liferay.language key="there-are-no-menu-items-to-display" />
		</div>
	</#if>
<#else>
	<#assign
		portletDisplay = themeDisplay.getPortletDisplay()

		navbarId = "navbar_" + portletDisplay.getId()
	/>

	<div id="${navbarId}">
		<ul aria-label=<@liferay.language key="site-pages" />" class="nav nav-pills navbar-site" role="menubar">
			<#assign navItems = entries />

			<#list navItems as navItem>
				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />

				<#if navItem.isBrowsable() || showChildrenNavItems>
					<#assign
						nav_item_attr_has_popup = ""
						nav_item_caret = ""
						nav_item_css_class = "lfr-nav-item nav-item"
						nav_item_href_link = ""
						nav_item_link_css_class = "nav-link text-truncate"
					/>

					<#if showChildrenNavItems>
						<#assign
							nav_item_attr_has_popup = "aria-haspopup=''true''"
							nav_item_caret = ''<span class="lfr-nav-child-toggle"><i class="icon-caret-down"></i></span>''
							nav_item_css_class = "${nav_item_css_class} dropdown"
							nav_item_link_css_class = "${nav_item_link_css_class} dropdown-toggle"
						/>
					</#if>

					<#if navItem.isBrowsable()>
						<#assign nav_item_href_link = "href=''${navItem.getURL()}''" />
					</#if>

					<#if navItem.isChildSelected() || navItem.isSelected()>
						<#assign
							nav_item_css_class = "${nav_item_css_class} selected active"
						/>
					</#if>

					<li class="${nav_item_css_class}" id="layout_${portletDisplay.getId()}_${navItem.getLayoutId()}" role="presentation">
						<a aria-labelledby="layout_${portletDisplay.getId()}_${navItem.getLayoutId()}" ${nav_item_attr_has_popup} class="${nav_item_link_css_class}" ${nav_item_href_link} ${navItem.getTarget()} role="menuitem">
							<span class="text-truncate"><@liferay_theme["layout-icon"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>
						</a>

						<#if showChildrenNavItems>
							<ul aria-expanded="false" class="child-menu dropdown-menu" role="menu">
								<@buildChildrenNavItems
									displayDepth=displayDepth
									navItem=navItem
								/>
							</ul>
						</#if>
					</li>
				</#if>
			</#list>
		</ul>
	</div>

	<@liferay_aui.script use="liferay-navigation-interaction">
		var navigation = A.one(''#${navbarId}'');

		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = ''.navbar-site'';
		Liferay.Data.NAV_LIST_SELECTOR = ''.navbar-site'';

		if (navigation) {
			navigation.plug(Liferay.NavigationInteraction);
		}
	</@>
</#if>',0,0,37733,NULL,NULL),
