Description><Description language-id="fr_FR">Affiche un menu de navigation avec une barre de navigation justifiée et minimaliste.</Description><Description language-id="de_DE">Zeigt ein Navigationsmenü mit einer minimalistischen justierten Navigationsleiste an.</Description><Description language-id="hu_HU">Megjelenít egy navigációs menüt egy minimálisan sorkizárt stílusú navigációs sávval.</Description><Description language-id="ja_JP">最小スタイルの等幅形式でナビゲーションメニューを表示します。</Description><Description language-id="pt_BR">Exibe um menu de navegação com uma barra de navegação minimamente justificada estilizada.</Description><Description language-id="es_ES">Muestra un menú de navegación con una barra de navegación con un estilo justificado mínimamente.</Description><Description language-id="sv_SE">Visar en navigeringsmeny med ett navigeringsfält justerat i minimal stil.</Description></root>',N'display',NULL,N'ftl',N'<#include "${templatesPath}/NAVIGATION-MACRO-FTL" />

<#if !entries?has_content>
	<#if themeDisplay.isSignedIn()>
		<div class="alert alert-info">
			<@liferay.language key="there-are-no-menu-items-to-display" />
		</div>
	</#if>
<#else>
	<#assign
		portletDisplay = themeDisplay.getPortletDisplay()

		navbarId = "navbar_" + portletDisplay.getId()
	/>

	<div id="${navbarId}">
		<ul aria-label="<@liferay.language key="site-pages" />" class="nav nav-justified navbar-blank navbar-nav navbar-site" role="menubar">
			<#assign navItems = entries />

			<#list navItems as navItem>
				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />

				<#if navItem.isBrowsable() || showChildrenNavItems>
					<#assign
						nav_item_attr_has_popup = ""
						nav_item_caret = ""
						nav_item_css_class = "lfr-nav-item nav-item"
						nav_item_href_link = ""
						nav_item_link_css_class = "nav-link text-truncate"
					/>

					<#if showChildrenNavItems>
						<#assign nav_item_attr_has_popup = "aria-haspopup=''true''" />
						<#assign nav_item_caret>
							<span class="lfr-nav-child-toggle">
								<@clay["icon"] symbol="angle-down" />
							</span>
						</#assign>
						<#assign
							nav_item_css_class = "${nav_item_css_class} dropdown"
							nav_item_link_css_class = "${nav_item_link_css_class} dropdown-toggle"
						/>
					</#if>

					<#if navItem.isBrowsable()>
						<#assign nav_item_href_link = "href=''${navItem.getURL()}''" />
					</#if>

					<#if navItem.isChildSelected() || navItem.isSelected()>
						<#assign
							nav_item_css_class = "${nav_item_css_class} selected active"
						/>
					</#if>

					<li class="${nav_item_css_class}" id="layout_${portletDisplay.getId()}_${navItem.getLayoutId()}" role="presentation">
						<a aria-labelledby="layout_${portletDisplay.getId()}_${navItem.getLayoutId()}" ${nav_item_attr_has_popup} class="${nav_item_link_css_class}" ${nav_item_href_link} ${navItem.getTarget()} role="menuitem">
							<span class="text-truncate"><@liferay_theme["layout-icon"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>
						</a>

						<#if showChildrenNavItems>
							<ul aria-expanded="false" class="child-menu dropdown-menu" role="menu">
								<@buildChildrenNavItems
									displayDepth=displayDepth
									navItem=navItem
								/>
							</ul>
						</#if>
					</li>
				</#if>
			</#list>
		</ul>
	</div>

	<@liferay_aui.script use="liferay-navigation-interaction">
		var navigation = A.one(''#${navbarId}'');

		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = ''.navbar-site'';
		Liferay.Data.NAV_LIST_SELECTOR = ''.navbar-site'';

		if (navigation) {
			navigation.plug(Liferay.NavigationInteraction);
		}
	</@>
</#if>',0,0,37751,NULL,NULL),
