ettynä painikkeina.</Description><Description language-id="fr_FR">Affiche un menu de navigation déroulant dont les éléments sont affichés sous la forme de boutons.</Description><Description language-id="de_DE">Zeigt ein Dropdown-Navigationsmenü mit Root-Menüelementen als Schaltflächen an.</Description><Description language-id="hu_HU">Megjelenít egy lenyíló navigációs menüt, amelyben a gyökérszintű menüpontok gombokként jelennek meg.</Description><Description language-id="ja_JP">ボタン形式のドロップダウンでナビゲーション メニューを表示します。</Description><Description language-id="pt_BR">Exibe um menu de navegação suspenso com itens do menu raiz mostrados como botões.</Description><Description language-id="es_ES">Muestra un menú de navegación desplegable con elementos de menú raíz que se muestran como botones.</Description><Description language-id="sv_SE">Visar en nedrullningsbar navigeringsmeny med rotmenyobjekt som visas som knappar.</Description></root>',N'display',NULL,N'ftl',N'<#include "${templatesPath}/NAVIGATION-MACRO-FTL" />

