	 (1,0,N'd14093bd-e732-bb63-5ddb-01222810fec9',37762,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:03',20038,0,37698,N'SITE-MAP-MULTI-COLUMN-LAYOUT-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Multi Column Layout</Name><Name language-id="ar_SA">تخطيط أعمدة متعددة</Name><Name language-id="ca_ES">Plana multi-columna</Name><Name language-id="zh_CN">多列布局</Name><Name language-id="nl_NL">Lay-out met meerdere kolommen</Name><Name language-id="fi_FI">Usean sarakkeen asettelu</Name><Name language-id="fr_FR">Mise en page multi-colonne</Name><Name language-id="de_DE">Multi-Spalten-Layout</Name><Name language-id="hu_HU">Több oszlopos elrendezés</Name><Name language-id="ja_JP">複数カラムレイアウト</Name><Name language-id="pt_BR">Layout em Múltiplas Colunas</Name><Name language-id="es_ES">Diseño con varias columnas</Name><Name language-id="sv_SE">Layout med flera kolumner</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays a column for each top level page. Each column includes the name of a top level page with the page''s immediate children listed underneath.</Description><Description language-id="ar_SA">يعرض عمودًا لكل صفحة مستوى أعلى. يتضمن كل عمود اسم صفحة المستوى العلوي بفروع متوسطة للصفحة مدرجة أسفلها.</Description><Description language-id="ca_ES">Mostra una columna per cada pàgina de nivell superior. A cada columna, s''hi inclou el nom d''una pàgina de nivell superior amb el fill immediat de la pàgina en una llista a la part inferior.</Description><Description language-id="zh_CN">为每个顶级页面显示一列。每一列都包含顶级页面的名称以及页面下所列的直接子级。</Description><Description language-id="nl_NL">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina''s eronder.</Description><Description language-id="fi_FI">Näyttää sarakkeen jokaiselle ylätason sivulle. Jokainen sarake sisältää ylätason sivun nimen ja sivun välittömät alasivut lueteltuna alapuolella.</Description><Description language-id="fr_FR">Affiche une colonne pour chaque page de niveau supérieur. Chaque colonne comprend le nom d''une page de niveau supérieur avec les enfants immédiats indiqués en-dessous.</Description><Description language-id="de_DE">Zeigt eine Spalte für jede Seite der obersten Ebene. Jede Spalte enthält den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id="hu_HU">Megjelenít egy oszlopot minden felső szintű oldalhoz. Mindegyik oszlop tartalmazza a legfelső szintű oldal nevét, alatta az oldal közvetlen utódjával.</Description><Description language-id="ja_JP">最上位のページごとに列を表示します。各列には、トップレベルのページの名前と、直下のサブページのページ名を含みます。</Description><Description language-id="pt_BR">Exibe uma coluna para cada página de nível superior. Cada coluna inclui o nome de uma página de nível superior com os filhos imediatos da página listados abaixo.</Description><Description language-id="es_ES">Muestra una columna por cada página de nivel superior. En cada columna, se incluye el nombre de una página de nivel superior con el elemento secundario inmediato de la página en una lista de la parte inferior.</Description><Description language-id="sv_SE">Visar en kolumn för varje sida på den högsta nivån. Varje kolumn inkluderar namnet på varje sida på den högsta nivån samt sidans omedelbara underordnade element listade under den.</Description></root>',N'display',NULL,N'ftl',N'<#if entries?has_content>
	<@liferay_aui.row>
		<#list entries as entry>
			<#if (getterUtil.getBoolean(showHiddenPages) || !entry.isHidden()) && layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, "VIEW")>
				<@liferay_aui.col width=25>
					<div class="results-header">
						<h3>
							<a

							<#assign layoutType = entry.getLayoutType() />

							<#if layoutType.isBrowsable()>
								href="${portalUtil.getLayoutURL(entry, themeDisplay)}"
							</#if>

							>${entry.getName(locale)}</a>
						</h3>
					</div>

					<@displayPages
						depth=1
						pages=entry.getChildren(permissionChecker)
					/>
				</@liferay_aui.col>
			</#if>
		</#list>
	</@liferay_aui.row>
</#if>

<#macro displayPages
	depth
	pages
>
	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>
		<ul class="child-pages">
			<#list pages as page>
				<#if getterUtil.getBoolean(showHiddenPages) || !page.isHidden()>
					<li>
						<a

						<#assign pageType = page.getLayoutType() />

						<#if pageType.isBrowsable()>
							href="${portalUtil.getLayoutURL(page, themeDisplay)}"
						</#if>

						>${page.getName(locale)}</a>

						<@displayPages
							depth=depth + 1
							pages=page.getChildren(permissionChecker)
						/>
					</li>
				</#if>
			</#list>
		</ul>
	</#if>
</#macro>',0,0,37763,NULL,NULL),
	 (1,0,N'cc0c0420-291c-17cc-d515-f42985fcd5ff',37765,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:06',27715,0,37698,N'COMMERCE-PRODUCT-DEFINITION-BASIC-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Basic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="nl_NL">Basis</Name><Name language-id="fi_FI">Perus</Name><Name language-id="fr_FR">Basique</Name><Name language-id="de_DE">Einfach</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="pt_BR">Básico</Name><Name language-id="es_ES">Básico</Name><Name language-id="sv_SE">Standard</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description></root>',N'display',NULL,N'ftl',N'<#assign count = 0
/>

<#if entries?has_content>
	<div class="row">
		<#list entries as curCPCatalogEntry>
			<#assign
				image = curCPCatalogEntry.getDefaultImageFileUrl()

				friendlyURL = cpContentHelper.getFriendlyURL(curCPCatalogEntry, themeDisplay)

				name = curCPCatalogEntry.getName()
			/>

			<div class="col-md-4">
