 ícone do marcador associado com cada idioma.</Description><Description language-id="es_ES">Muestra el icono de la bandera asociada con cada idioma.</Description><Description language-id="sv_SE">Visar ikonen på flaggan som är associerad med varje språk.</Description></root>',N'display',NULL,N'ftl',N'<#if entries?has_content>
