uage-id="ja_JP">各言語 (スペイン語など) を完全な名前で表示します</Description><Description language-id="pt_BR">Exibe o nome completo de cada idioma (por exemplo, Espanhol).</Description><Description language-id="es_ES">Muestra el nombre completo de cada idioma (por ejemplo, español).</Description><Description language-id="sv_SE">Visar det fullständiga namnet på varje språk (t.ex. spanska).</Description></root>',N'display',NULL,N'ftl',N'<style>
