	 (1,0,N'3a94893b-cdc6-fbc5-656b-db377d4da937',37777,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:08',27716,0,37698,N'LANGUAGE-SELECT-BOX-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Select Box</Name><Name language-id="ar_SA">تحديد مربع</Name><Name language-id="ca_ES">Selecciona la casella</Name><Name language-id="zh_CN">选择框</Name><Name language-id="nl_NL">Selectievak</Name><Name language-id="fi_FI">Valintalaatikko</Name><Name language-id="fr_FR">Sélectionner la case</Name><Name language-id="de_DE">Auswahlkasten</Name><Name language-id="hu_HU">Jelölje be</Name><Name language-id="ja_JP">セレクトボックス</Name><Name language-id="pt_BR">Caixa de seleção</Name><Name language-id="es_ES">Cuadro de selección</Name><Name language-id="sv_SE">Markeringsruta</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays a select box with the selected languages.</Description><Description language-id="ar_SA">يعرض خانة اختيار باللغات المحددة.</Description><Description language-id="ca_ES">Mostra una casella amb els idiomes seleccionats.</Description><Description language-id="zh_CN">显示带有选定语言的选择框。</Description><Description language-id="nl_NL">Geeft een selectievak weer met de geselecteerde talen.</Description><Description language-id="fi_FI">Näyttää valittuihin kieliin liittyvän valintalaatikon.</Description><Description language-id="fr_FR">Affiche une boîte de sélection contenant les langues choisies.</Description><Description language-id="de_DE">Zeigt einen Auswahlkasten mit den ausgewählten Sprachen an.</Description><Description language-id="hu_HU">Megjelenít egy választómezőt a kiválasztott nyelvekkel.</Description><Description language-id="ja_JP">セレクトボックスで選択された言語を表示します。</Description><Description language-id="pt_BR">Exibe uma caixa de seleção com os idiomas selecionados.</Description><Description language-id="es_ES">Muestra una casilla con los idiomas seleccionados.</Description><Description language-id="sv_SE">Visar en markeringsruta med de valda språken.</Description></root>',N'display',NULL,N'ftl',N'<#if entries?has_content>
	<#assign languageId = localeUtil.toLanguageId(locale) />

	<style>
		.taglib-language-option {
			background: none no-repeat 5px center;
			padding-left: 25px;
		}

		<#list entries as entry>
			.taglib-language-option-${entry.getW3cLanguageId()} {
				background-image: url(${themeDisplay.getPathThemeImages()}/language/${entry.getLanguageId()}.png);
			}
		</#list>
	</style>

	<@liferay_aui["form"]
		action=formAction
		method="post"
		name=''${namespace + formName}''
		useNamespace=false
	>
		<@liferay_aui["select"]
			changesContext=true
			id=''${namespace + formName}''
			label=""
			name=''${name}''
			onChange=''${namespace + "changeLanguage();"}''
			title="language"
		>
			<#list entries as entry>
				<@liferay_aui["option"]
					cssClass="taglib-language-option taglib-language-option-${entry.getW3cLanguageId()}"
					disabled=entry.isDisabled()
					label=entry.getLongDisplayName()
					lang=entry.getW3cLanguageId()
					localizeLabel=false
					selected=entry.isSelected()
					value=entry.getLanguageId()
				/>
			</#list>
		</@>
	</@>

	<@liferay_aui["script"]>
		function ${namespace}changeLanguage() {
			submitForm(document.${namespace + formName});
		}
	</@>
</#if>',0,0,37778,NULL,NULL),
	 (1,0,N'0d9f6a37-5dff-e8d4-b7a5-e784ac01bddf',37780,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:08',27716,0,37698,N'LANGUAGE-SHORT-TEXT-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Short Text</Name><Name language-id="ar_SA">نص قصير</Name><Name language-id="ca_ES">Text curt</Name><Name language-id="zh_CN">短文本</Name><Name language-id="nl_NL">Korte tekst</Name><Name language-id="fi_FI">Lyhyt Teksti</Name><Name language-id="fr_FR">Texte Court</Name><Name language-id="de_DE">Kurztext</Name><Name language-id="hu_HU">Rövid szöveg</Name><Name language-id="ja_JP">短いテキスト</Name><Name language-id="pt_BR">Texto curto</Name><Name language-id="es_ES">Texto corto</Name><Name language-id="sv_SE">Kort text</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays an abbreviation of each language (e.g. ES).</Description><Description language-id="ar_SA">يعرض اختصارًا لكل لغة (مثل، ES).</Description><Description language-id="ca_ES">Mostra una abreviatura de cada idioma (p. ex. ES).</Description><Description language-id="zh_CN">显示每种语言的缩写（例如，ES）。</Description><Description language-id="nl_NL">Geeft een afkorting weer van elke taal (bijv. ES).</Description><Description language-id="fi_FI">Näyttää jokaisen kielen lyhenteen (esim. ES).</Description><Description language-id="fr_FR">Affiche une abréviation pour chaque langue (par ex. : ES).</Description><Description language-id="de_DE">Zeigt eine Abkürzung jeder Sprache an (z. B. ES).</Description><Description language-id="hu_HU">Megjeleníti az egyes nyelvek rövidítését (pl. ES).</Description><Description language-id="ja_JP">各言語 (例えば ES) の省略形で表示します。</Description><Description language-id="pt_BR">Exibe uma abreviatura de cada idioma (por exemplo, ES).</Description><Description language-id="es_ES">Muestra una abreviatura de cada idioma (por ejemplo, ES).</Description><Description language-id="sv_SE">Visar en förkortning av varje språk (t.ex. ES).</Description></root>',N'display',NULL,N'ftl',N'<style>
	.language-entry-short-text {
