	 (1,0,N'7522dcfc-f6c8-5e35-2a3a-61ea67a5770f',37783,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:06',20008,0,37698,N'ASSET-TAGS-NAVIGATION-COLOR-BY-POPULARITY-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Color by Popularity</Name><Name language-id="ar_SA">الألوان حسب الأولوية</Name><Name language-id="ca_ES">Color per popularitat</Name><Name language-id="zh_CN">受欢迎的颜色</Name><Name language-id="nl_NL">Kleur op populariteit</Name><Name language-id="fi_FI">Väri suosion mukaan</Name><Name language-id="fr_FR">Couleur par popularité</Name><Name language-id="de_DE">Nach Popularität färben</Name><Name language-id="hu_HU">Szín népszerűség alapján</Name><Name language-id="ja_JP">頻出度により色分けする</Name><Name language-id="pt_BR">Colorir por Popularidade</Name><Name language-id="es_ES">Color por popularidad</Name><Name language-id="sv_SE">Färga efter popularitet</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description><Description language-id="ar_SA">يعرض علامات الأصول الملونة حسب الأولوية: الأحمر (مرتفع) والأصفر (متوسط) والأخضر (منخفض).</Description><Description language-id="ca_ES">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id="zh_CN">显示资源标签颜色等级： 红色 (高), 黄色 (中), 绿色 (低).</Description><Description language-id="nl_NL">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description><Description language-id="fi_FI">Näyttää sisältötageja, mitkä on väritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virheä (alhainen)</Description><Description language-id="fr_FR">Affiche les étiquettes d''asset coloriées par popularité: rouge (élevé), jaune (moyen), et vert (bas).</Description><Description language-id="de_DE">Schlagwörter nach Popularität färben: Rot (hoch), gelb (mittel), grün (niedrig).</Description><Description language-id="hu_HU">Megjeleníti a tartalom címkéket népszerűség szerint színezve: vörös (magas), sárga (közepes), és zöld (alacsony).</Description><Description language-id="ja_JP">アセットタグを人気順に表示する:赤(高い)、黄色（普通)、緑（低い）</Description><Description language-id="pt_BR">Exibe marcadores coloridos por popularidade: vermelho (alta), amarelo (média) e verde (baixa).</Description><Description language-id="es_ES">Muestra las etiquetas de contenido coloreadas según su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id="sv_SE">Visar tillgångstaggar färgade efter popularitet: röd (hög), gul (medelhög) och grön (låg).</Description></root>',N'display',NULL,N'ftl',N'<#if entries?has_content>
	<ul class="tag-items tag-list">
		<#assign
			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())
			classNameId = getterUtil.getLong(classNameId, 0)

			maxCount = 1
			minCount = 1
		/>

		<#list entries as entry>
			<#assign
				maxCount = liferay.max(maxCount, entry.getAssetCount())
				minCount = liferay.min(minCount, entry.getAssetCount())
			/>
		</#list>

		<#assign multiplier = 1 />

		<#if maxCount != minCount>
			<#assign multiplier = 3 / (maxCount - minCount) />
		</#if>

		<#list entries as entry>
			<li class="taglib-asset-tags-summary">
				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />

				<#if popularity < 1>
					<#assign color = "green" />
				<#elseif (popularity >= 1) && (popularity < 2)>
					<#assign color = "orange" />
				<#else>
					<#assign color = "red" />
				</#if>

				<#assign tagURL = renderResponse.createRenderURL() />

				${tagURL.setParameter("resetCur", "true")}
				${tagURL.setParameter("tag", entry.getName())}

				<a class="tag" href="${tagURL}" style="color: ${color};">
					${entry.getName()}

					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>
						<span class="tag-asset-count">(${entry.getAssetCount()})</span>
					</#if>
				</a>
			</li>
		</#list>
	</ul>

	<br style="clear: both;" />
</#if>',0,0,37784,NULL,NULL),
	 (1,0,N'5e53d77d-0132-c9ae-a32d-ecf569db2403',37786,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:03',27717,0,37698,N'CATEGORY-FACET-CLOUD-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Cloud Layout</Name><Name language-id="ar_SA">مخطط السحابة</Name><Name language-id="ca_ES">Disposició del núvol</Name><Name language-id="zh_CN">云布局</Name><Name language-id="nl_NL">Cloudlay-out</Name><Name language-id="fi_FI">Pilviasettelu</Name><Name language-id="fr_FR">Disposition du cloud</Name><Name language-id="de_DE">Cloudlayout</Name><Name language-id="hu_HU">Felhő elrendezés</Name><Name language-id="ja_JP">クラウドのレイアウト</Name><Name language-id="pt_BR">Layout de nuvem</Name><Name language-id="es_ES">Diseño de nube</Name><Name language-id="sv_SE">Cloud-layout</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display terms as an inline list of links with varying sizes based on frequency.</Description><Description language-id="ar_SA">عرض المصطلحات كقائمة مدمجة من الروابط بأحجام مختلفة تبعًا للتردد.</Description><Description language-id="ca_ES">Mostra els termes com una llista integrada d''enllaços amb diverses mides basats en la freqüència.</Description><Description language-id="zh_CN">将搜索词显示为大小随频率变化的内联链接列表。</Description><Description language-id="nl_NL">Termen weergeven als een gealigneerde lijst met links van verschillende lengte op basis van frequentie.</Description><Description language-id="fi_FI">Näytä termit inline-luettelona koko vaihdellen esiintymistaajuuden mukaan.</Description><Description language-id="fr_FR">Afficher les termes sous la forme d''une liste intégrée de liens dont les tailles varient en fonction des fréquences.</Description><Description language-id="de_DE">Begriffe als eingebettete Linkliste mit unterschiedlichen Größen auf Basis der Häufigkeit anzeigen.</Description><Description language-id="hu_HU">Jelenítse meg a kifejezéseket hivatkozások sorközi listájaként a gyakoriságtól függően változó méretben.</Description><Description language-id="ja_JP">用語を頻度に応じてサイズが変わるインライン形式のリンクリストとして表示します。</Description><Description language-id="pt_BR">Exibir termos como uma lista embutida de links com tamanhos variados baseados pela frequência.</Description><Description language-id="es_ES">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id="sv_SE">Visa villkoren som en infogad lista med länkar med olika storlekar baserat på frekvens.</Description></root>',N'display',NULL,N'ftl',N'<@liferay_ui["panel-container"]
	extended=true
	id="${namespace + ''facetAssetCategoriesPanelContainer''}"
	markupView="lexicon"
	persistState=true
>
	<@liferay_ui.panel
		collapsible=true
		cssClass="search-facet"
		id="${namespace + ''facetAssetCategoriesPanel''}"
		markupView="lexicon"
		persistState=true
		title="category"
	>
		<ul class="list-unstyled tag-cloud">
			<#if entries?has_content>
				<#list entries as entry>
					<span class="facet-value">
						<button
							class="btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(''facet-term-selected'', ''facet-term-unselected'')} tag-popularity-${entry.getPopularity()} term-name"
							data-term-id="${entry.getAssetCategoryId()}"
							disabled
							onClick="Liferay.Search.FacetUtil.changeSelection(event);"
						>
							${htmlUtil.escape(entry.getDisplayName())}
						</button>
					</span>
				</#list>
			</#if>
		</ul>

		<#if !assetCategoriesSearchFacetDisplayContext.isNothingSelected()>
			<@liferay_aui.button
				cssClass="btn-link btn-unstyled facet-clear-btn"
				onClick="Liferay.Search.FacetUtil.clearSelections(event);"
				value="clear"
			/>
		</#if>
	</@>
</@>',0,0,37787,NULL,NULL);
