	 (1,0,N'2b14e2b7-bad7-3985-537d-c34b19fcd030',37810,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:04',27721,0,37698,N'MODIFIED-FACET-RADIO-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Radio Layout</Name><Name language-id="ar_SA">مخطط الراديو</Name><Name language-id="ca_ES">Disposició de ràdio</Name><Name language-id="zh_CN">单选按钮布局</Name><Name language-id="nl_NL">Keuzerondjeslay-out</Name><Name language-id="fi_FI">Valintapainikeasettelu</Name><Name language-id="fr_FR">Disposition radio</Name><Name language-id="de_DE">Optionsfelderlayout</Name><Name language-id="hu_HU">Rádió elrendezés</Name><Name language-id="ja_JP">ラジオのレイアウト</Name><Name language-id="pt_BR">Layout de rádio</Name><Name language-id="es_ES">Diseño de radio</Name><Name language-id="sv_SE">Radio-layout</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display terms with radio buttons.</Description><Description language-id="ar_SA">عرض المصطلحات بأزرار اختيار.</Description><Description language-id="ca_ES">Mostra els termes amb botons de ràdio.</Description><Description language-id="zh_CN">将搜索词显示为单选按钮。</Description><Description language-id="nl_NL">Termen weergeven met checkboxen.</Description><Description language-id="fi_FI">Näytä termit radiopainikkeina.</Description><Description language-id="fr_FR">Afficher les termes avec les boutons radio.</Description><Description language-id="de_DE">Begriffe mit Optionsfeldern anzeigen.</Description><Description language-id="hu_HU">Jelenítse meg a kifejezéseket rádiógombokkal.</Description><Description language-id="ja_JP">用語をラジオボタン付きで表示します。</Description><Description language-id="pt_BR">Exibir termos como botões de rádio.</Description><Description language-id="es_ES">Muestra términos con botones de radio.</Description><Description language-id="sv_SE">Visa villkoren med radioknappar.</Description></root>',N'display',NULL,N'ftl',N'<@liferay_ui["panel-container"]
	extended=true
	id="${namespace + ''facetModifiedPanelContainer''}"
	markupView="lexicon"
	persistState=true
>
	<@liferay_ui.panel
		collapsible=true
		cssClass="search-facet"
		id="${namespace + ''facetModifiedPanel''}"
		markupView="lexicon"
		persistState=true
		title="last-modified"
	>
		<ul class="list-unstyled modified">
			<#if entries?has_content>
				<#list entries as entry>
					<li class="facet-value">
						<div class="custom-control custom-radio">
							<label class="facet-checkbox-label" for="${entry.getLabel()}">
								<input
									${(entry.isSelected())?then("checked", "")}
									class="custom-control-input facet-term"
									disabled
									id="${entry.getLabel()}"
									name="${entry.getLabel()}"
									onChange=''${"window.location.href = \"${entry.getRangeURL()}\";"}''
									role="radio"
									type="radio"
								/>

								<span class="custom-control-label term-name ${(entry.isSelected())?then(''facet-term-selected'', ''facet-term-unselected'')}">
									<span class="custom-control-label-text">
										<@liferay_ui["message"] key="${htmlUtil.escape(entry.getLabel())}" />
									</span>
								</span>

								<small class="term-count">
									(${entry.getFrequency()})
								</small>
							</label>
						</div>
					</li>
				</#list>
			</#if>

			<li class="facet-value">
				<div class="custom-control custom-radio">
					<label class="facet-checkbox-label" for="${customRangeModifiedFacetTermDisplayContext.getLabel()}">
						<input
							${(customRangeModifiedFacetTermDisplayContext.isSelected())?then("checked", "")}
							class="custom-control-input facet-term"
							disabled
							id="${customRangeModifiedFacetTermDisplayContext.getLabel()}"
							name="${customRangeModifiedFacetTermDisplayContext.getLabel()}"
							onChange=''${"window.location.href = \"${customRangeModifiedFacetTermDisplayContext.getRangeURL()}\";"}''
							role="radio"
							type="radio"
						/>

						<span class="custom-control-label term-name ${(customRangeModifiedFacetTermDisplayContext.isSelected())?then(''facet-term-selected'', ''facet-term-unselected'')}">
							<span class="custom-control-label-text">
								<@liferay_ui["message"] key="${htmlUtil.escape(customRangeModifiedFacetTermDisplayContext.getLabel())}" />
							</span>
						</span>

						<#if customRangeModifiedFacetTermDisplayContext.isSelected()>
							<small class="term-count">
								(${customRangeModifiedFacetTermDisplayContext.getFrequency()})
							</small>
						</#if>
					</label>
				</div>
			</li>

			<div class="${(!modifiedFacetCalendarDisplayContext.isSelected())?then("hide", "")} modified-custom-range" id="${namespace}customRange">
				<div class="col-md-6" id="${namespace}customRangeFrom">
					<@liferay_aui["field-wrapper"] label="from">
						<@liferay_ui["input-date"]
							cssClass="modified-facet-custom-range-input-date-from"
							dayParam="fromDay"
							dayValue=modifiedFacetCalendarDisplayContext.getFromDayValue()
							disabled=false
							firstDayOfWeek=modifiedFacetCalendarDisplayContext.getFromFirstDayOfWeek()
							monthParam="fromMonth"
							monthValue=modifiedFacetCalendarDisplayContext.getFromMonthValue()
							name="fromInput"
							yearParam="fromYear"
							yearValue=modifiedFacetCalendarDisplayContext.getFromYearValue()
						/>
					</@>
				</div>

				<div class="col-md-6" id="${namespace}customRangeTo">
					<@liferay_aui["field-wrapper"] label="to">
						<@liferay_ui["input-date"]
							cssClass="modified-facet-custom-range-input-date-to"
							dayParam="toDay"
							dayValue=modifiedFacetCalendarDisplayContext.getToDayValue()
							disabled=false
							firstDayOfWeek=modifiedFacetCalendarDisplayContext.getToFirstDayOfWeek()
							monthParam="toMonth"
							monthValue=modifiedFacetCalendarDisplayContext.getToMonthValue()
							name="toInput"
							yearParam="toYear"
							yearValue=modifiedFacetCalendarDisplayContext.getToYearValue()
						/>
					</@>
				</div>

				<@liferay_aui.button
					cssClass="modified-facet-custom-range-filter-button"
					disabled=modifiedFacetCalendarDisplayContext.isRangeBackwards()
					name="searchCustomRangeButton"
					value="search"
				/>
			</div>
		</ul>

		<#if !modifiedFacetDisplayContext.isNothingSelected()>
			<@liferay_aui.button
				cssClass="btn-link btn-unstyled facet-clear-btn"
				onClick="Liferay.Search.FacetUtil.clearSelections(event);"
				value="clear"
			/>
		</#if>
	</@>
</@>',0,0,37811,NULL,NULL),
	 (1,0,N'fe377e52-bc46-2e54-3c54-fb57425a5f50',37813,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:04',27722,0,37698,N'SEARCH-BAR-LEFT-ALIGNED-ICON-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Left Aligned Icon Layout</Name><Name language-id="ar_SA">مخطط رموز تمت محاذاتها لليسار</Name><Name language-id="ca_ES">Disposició de la icona alineada a l''esquerra</Name><Name language-id="zh_CN">左对齐图标布局</Name><Name language-id="nl_NL">Lay-out met pictogram links uitgelijnd</Name><Name language-id="fi_FI">Vasemmalle Tasattu Kuvakkeiden Asettelu</Name><Name language-id="fr_FR">Disposition icône alignée à gauche</Name><Name language-id="de_DE">Links ausgerichtetes Symbollayout</Name><Name language-id="hu_HU">Elrendezés balra igazított ikonnal</Name><Name language-id="ja_JP">左揃えのアイコンレイアウト</Name><Name language-id="pt_BR">Layout do Ícone Alinhado à Esquerda</Name><Name language-id="es_ES">Diseño de icono alineado a la izquierda</Name><Name language-id="sv_SE">Layout för vänsterjusterad ikon</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display the search icon on the left.</Description><Description language-id="ar_SA">عرض رمز البحث على اليسار.</Description><Description language-id="ca_ES">Mostra la icona de cerca a l''esquerra.</Description><Description language-id="zh_CN">在左侧显示搜索图标。</Description><Description language-id="nl_NL">Het zoekpictogram links weergeven.</Description><Description language-id="fi_FI">Näytä hakukuvake vasemmalla.</Description><Description language-id="fr_FR">Afficher l''icône de recherche sur la gauche.</Description><Description language-id="de_DE">Such-Symbol links anzeigen.</Description><Description language-id="hu_HU">Jelenítse meg a keresés ikonját a bal oldalon.</Description><Description language-id="ja_JP">検索アイコンを左側に表示します。</Description><Description language-id="pt_BR">Exibir o ícone de busca à esquerda.</Description><Description language-id="es_ES">Muestra el icono de buscar en la parte izquierda.</Description><Description language-id="sv_SE">Visa sökikonen till vänster.</Description></root>',N'display',NULL,N'ftl',N'<@liferay_aui.fieldset cssClass="search-bar">
	<@liferay_aui.input
		cssClass="search-bar-empty-search-input"
		name="emptySearchEnabled"
		type="hidden"
		value=searchBarPortletDisplayContext.isEmptySearchEnabled()
	/>

	<div class="input-group ${searchBarPortletDisplayContext.isLetTheUserChooseTheSearchScope()?then("search-bar-scope","search-bar-simple")}">
		<#if searchBarPortletDisplayContext.isLetTheUserChooseTheSearchScope()>
			<div class="input-group-item input-group-item-shrink input-group-prepend">
				<button aria-label="${languageUtil.get(locale, "submit")}" class="btn btn-secondary" type="submit">
					<@clay.icon symbol="search" />
				</button>
			</div>

			<@liferay_aui.select
				cssClass="search-bar-scope-select"
				label=""
				name=htmlUtil.escape(searchBarPortletDisplayContext.getScopeParameterName())
				title="scope"
				useNamespace=false
				wrapperCssClass="input-group-item input-group-item-shrink input-group-prepend search-bar-search-select-wrapper"
			>
				<@liferay_aui.option
				label="this-site"
				selected=searchBarPortletDisplayContext.isSelectedCurrentSiteSearchScope()
				value=searchBarPortletDisplayContext.getCurrentSiteSearchScopeParameterString()
				/>

				<#if searchBarPortletDisplayContext.isAvailableEverythingSearchScope()>
					<@liferay_aui.option
						label="everything"
						selected=searchBarPortletDisplayContext.isSelectedEverythingSearchScope()
						value=searchBarPortletDisplayContext.getEverythingSearchScopeParameterString()
					/>
				</#if>
			</@>

			<#assign data = {
				"test-id": "searchInput"
			} />

			<@liferay_aui.input
				autoFocus=true
				cssClass="search-bar-keywords-input"
				data=data
				label=""
				name=htmlUtil.escape(searchBarPortletDisplayContext.getKeywordsParameterName())
				placeholder=searchBarPortletDisplayContext.getInputPlaceholder()
				title=languageUtil.get(locale, "search")
				type="text"
				useNamespace=false
				value=htmlUtil.escape(searchBarPortletDisplayContext.getKeywords())
				wrapperCssClass="input-group-item input-group-append search-bar-keywords-input-wrapper"
			/>
		<#else>
			<div class="input-group-item search-bar-keywords-input-wrapper">
				<input
					class="form-control input-group-inset input-group-inset-before search-bar-keywords-input"
					data-qa-id="searchInput"
					id="${namespace + stringUtil.randomId()}"
					name="${htmlUtil.escape(searchBarPortletDisplayContext.getKeywordsParameterName())}"
					placeholder="${searchBarPortletDisplayContext.getInputPlaceholder()}"
					title="${languageUtil.get(locale, "search")}"
					type="text"
					value="${htmlUtil.escape(searchBarPortletDisplayContext.getKeywords())}"
				/>

				<div class="input-group-inset-item input-group-inset-item-before">
					<button aria-label="${languageUtil.get(locale, "submit")}" class="btn btn-unstyled" type="submit">
						<@clay.icon symbol="search" />
					</button>
				</div>

				<@liferay_aui.input
					name=htmlUtil.escape(searchBarPortletDisplayContext.getScopeParameterName())
					type="hidden"
					value=searchBarPortletDisplayContext.getScopeParameterValue()
				/>
			</div>
		</#if>
	</div>
</@>',0,0,37814,NULL,NULL),
