>Exibir resultados com apenas seus títulos.</Description><Description language-id="es_ES">Muestra resultados solo con el título.</Description><Description language-id="sv_SE">Visa bara resultat med titel.</Description></root>',N'display',NULL,N'ftl',N'<div class="search-total-label">
	${languageUtil.format(locale, "x-results-for-x", [searchContainer.getTotal(), "<strong>" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + "</strong>"], false)}
