INSERT INTO DDMTemplate (mvccVersion,ctCollectionId,uuid_,templateId,groupId,companyId,userId,userName,versionUserId,versionUserName,createDate,modifiedDate,classNameId,classPK,resourceClassNameId,templateKey,version,name,description,type_,mode_,[language],script,cacheable,smallImage,smallImageId,smallImageURL,lastPublishDate) VALUES
	 (1,0,N'610dbae7-ba88-30be-2eb9-e60b821cea5c',37819,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:04',27723,0,37698,N'SEARCH-RESULTS-LIST-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">List Layout</Name><Name language-id="ar_SA">مخطط قائمة</Name><Name language-id="ca_ES">Disposició de la llista</Name><Name language-id="zh_CN">列表布局</Name><Name language-id="nl_NL">Lijstlay-out</Name><Name language-id="fi_FI">Luetteloasettelu</Name><Name language-id="fr_FR">Disposition en liste</Name><Name language-id="de_DE">Listenlayout</Name><Name language-id="hu_HU">Lista elrendezés</Name><Name language-id="ja_JP">リストレイアウト</Name><Name language-id="pt_BR">Layout da Lista</Name><Name language-id="es_ES">Diseño de lista</Name><Name language-id="sv_SE">Listlayout</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display results with their title, creator''s user name, asset type, and creation date.</Description><Description language-id="ar_SA">عرض النتائج من خلال عناوينها، واسم المستخدم المنشئ ونوع الأصل وتاريخ الإنشاء.</Description><Description language-id="ca_ES">Mostra els resultats amb el títol, el nom d''usuari del creador, el tipus de contingut i la data de creació.</Description><Description language-id="zh_CN">显示结果及其标题、创建者用户名、资源类型和创建日期。</Description><Description language-id="nl_NL">Resultaten weergeven met hun titel, de gebruikersnaam van de maker, het assettype en de aanmaakdatum.</Description><Description language-id="fi_FI">Näytä tulokset otsikoineen, luojan käyttäjänimineen, sisältötyyppeineen ja luontipäivineen.</Description><Description language-id="fr_FR">Afficher les résultats avec leur intitulé, le nom d''utilisateur du créateur, le type d''actif et la date de création.</Description><Description language-id="de_DE">Ergebnisse mit deren Titel, Benutzername des Erstellers, Assettyp und Erstellungsdatum anzeigen.</Description><Description language-id="hu_HU">A találatokat jelenítse meg címmel, a készítő felhasználónevével, tartalomtípussal és leírással.</Description><Description language-id="ja_JP">結果とそのタイトル、作成者のユーザー名、アセットタイプ、作成日を表示します。</Description><Description language-id="pt_BR">Exibir resultados com seus títulos, nome de usuário do criador, tipo de conteúdo e data de criação.</Description><Description language-id="es_ES">Muestra resultados con el título, el nombre de usuario del autor, el tipo de activo y la fecha de creación.</Description><Description language-id="sv_SE">Visa resultat med titel, skaparens användarnamn, tillgångstyp och skapandedatum.</Description></root>',N'display',NULL,N'ftl',N'<div class="search-total-label">
	${languageUtil.format(locale, "x-results-for-x", [searchContainer.getTotal(), "<strong>" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + "</strong>"], false)}
</div>

<div class="display-list">
	<ul class="list-group" id="search-results-display-list">
		<#if entries?has_content>
			<#list entries as entry>
				<li class="list-group-item list-group-item-flex">
					<#if !entry.isTemporarilyUnavailable()>
						<div class="autofit-col">
							<#if entry.isUserPortraitVisible()>
								<@liferay_ui["user-portrait"] userId=entry.getAssetEntryUserId() />
							</#if>

							<#if entry.isThumbnailVisible()>
								<img alt="${languageUtil.get(locale, "thumbnail")}" class="img-rounded search-result-thumbnail-img" src="${entry.getThumbnailURLString()}" />
							</#if>

							<#if entry.isIconVisible()>
								<span class="search-asset-type-sticker sticker sticker-rounded sticker-secondary sticker-static">
									<@clay.icon symbol="${entry.getIconId()}" />
								</span>
							</#if>
						</div>

						<div class="autofit-col autofit-col-expand">
							<section class="autofit-section">
								<div class="list-group-title">
									<a href="${entry.getViewURL()}">
										${entry.getHighlightedTitle()}
									</a>
								</div>

								<div class="search-results-metadata">
									<p class="list-group-subtext">
										<#if entry.isModelResourceVisible()>
											<span class="subtext-item">
												<strong>${entry.getModelResource()}</strong>
											</span>
										</#if>

										<#if entry.isLocaleReminderVisible()>
											<@liferay_ui["icon"]
												icon="../language/${entry.getLocaleLanguageId()}"
												message=entry.getLocaleReminder()
											/>
										</#if>

										<#if entry.isCreatorVisible()>
											<span class="subtext-item">
												&#183;

												<@liferay.language key="written-by" />

												<strong>${htmlUtil.escape(entry.getCreatorUserName())}</strong>
											</span>
										</#if>

										<#if entry.isCreationDateVisible()>
											<span class="subtext-item">
