	 (1,0,N'af3e6a09-898b-f8de-c0ae-e9c4483d7405',37849,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:05',27728,0,37698,N'USER-FACET-COMPACT-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Compact Layout</Name><Name language-id="ar_SA">مخطط مضغوط</Name><Name language-id="ca_ES">Disposició compacta</Name><Name language-id="zh_CN">紧凑布局</Name><Name language-id="nl_NL">Compacte lay-out</Name><Name language-id="fi_FI">Tiivis Asettelu</Name><Name language-id="fr_FR">Disposition compacte</Name><Name language-id="de_DE">Kompaktes Layout</Name><Name language-id="hu_HU">Kompakt elrendezés</Name><Name language-id="ja_JP">コンパクトレイアウト</Name><Name language-id="pt_BR">Layout Compacto</Name><Name language-id="es_ES">Diseño compacto</Name><Name language-id="sv_SE">Kompakt layout</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display terms as a list of links.</Description><Description language-id="ar_SA">عرض المصطلحات كقائمة من الروابط.</Description><Description language-id="ca_ES">Mostra els termes com una llista d''enllaços.</Description><Description language-id="zh_CN">将搜索词显示为链接列表。</Description><Description language-id="nl_NL">Termen weergeven als een lijst met links.</Description><Description language-id="fi_FI">Näytä termit linkkien luettelona.</Description><Description language-id="fr_FR">Afficher les termes sous la forme de liste de liens.</Description><Description language-id="de_DE">Begriffe als Linkliste anzeigen.</Description><Description language-id="hu_HU">Jelenítse meg a kifejezéseket hivatkozások listájaként.</Description><Description language-id="ja_JP">用語をリンクリストとして表示します。</Description><Description language-id="pt_BR">Exibir termos como uma lista de links.</Description><Description language-id="es_ES">Muestra términos como una lista de enlaces.</Description><Description language-id="sv_SE">Visa villkoren som en lista med länkar.</Description></root>',N'display',NULL,N'ftl',N'<@liferay_ui["panel-container"]
