</@>',0,0,37850,NULL,NULL),
	 (1,0,N'e16a479e-0d03-329f-98a8-1d89233b3a01',37852,37631,37601,37607,NULL,37607,NULL,'2021-04-25 05:43:40','2021-12-17 04:22:05',27728,0,37698,N'USER-FACET-LABEL-FTL',N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Label Layout</Name><Name language-id="ar_SA">مخطط التسمية</Name><Name language-id="ca_ES">Disposició de l''etiqueta</Name><Name language-id="zh_CN">标签布局</Name><Name language-id="nl_NL">Labellay-out</Name><Name language-id="fi_FI">Selitteen Asettelu</Name><Name language-id="fr_FR">Disposition des libellés</Name><Name language-id="de_DE">Bezeichnungslayout</Name><Name language-id="hu_HU">Címke elrendezése</Name><Name language-id="ja_JP">ラベルレイアウト</Name><Name language-id="pt_BR">Layout do Rótulo</Name><Name language-id="es_ES">Diseño de etiquetas</Name><Name language-id="sv_SE">Etikettlayout</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display terms as an inline list of labels.</Description><Description language-id="ar_SA">عرض المصطلحات كقائمة مدمجة من التسميات.</Description><Description language-id="ca_ES">Mostra els termes com una llista integrada d''etiquetes.</Description><Description language-id="zh_CN">将搜索词显示为内联标签列表。</Description><Description language-id="nl_NL">Termen weergeven als een gealigneerde lijst met links.</Description><Description language-id="fi_FI">Näytä termit linline-otsikkoluettelona.</Description><Description language-id="fr_FR">Afficher les termes sous la forme de liste intégrée de libellés.</Description><Description language-id="de_DE">Begriffe als eingebettete Labelliste anzeigen.</Description><Description language-id="hu_HU">Jelenítse meg a kifejezéseket címkék sorközi listájaként.</Description><Description language-id="ja_JP">用語をインライン形式のリストとして表示します。</Description><Description language-id="pt_BR">Exibir termos como uma lista embutida de rótulos.</Description><Description language-id="es_ES">Muestra términos como una lista de etiquetas en línea.</Description><Description language-id="sv_SE">Visa villkoren som en infogad lista med etiketter.</Description></root>',N'display',NULL,N'ftl',N'<@liferay_ui["panel-container"]
