</div>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37707,37631,37601,37607,NULL,'2021-04-25 05:43:40',27707,0,37705,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Standard</Name><Name language-id="pt_BR">Básico</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="fr_FR">Basique</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="de_DE">Einfach</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="fi_FI">Perus</Name><Name language-id="en_US">Basic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="es_ES">Básico</Name><Name language-id="nl_NL">Basis</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>',N'ftl',N'<#assign count = 0 />

<div class="container-fluid-1280" style="text-align:center">
	<div class="row" style="padding:15px">
		<#if entries?has_content>
			<#list entries as curCommerceAddress>
				<div class="col-md-4" style="text-align:left">
					<#assign
						editURL = commerceAddressDisplayContext.getEditCommerceAddressURL(curCommerceAddress.getCommerceAddressId())

						deleteURL = commerceAddressDisplayContext.getDeleteCommerceAddressURL(curCommerceAddress.getCommerceAddressId())

						editButtonValue = languageUtil.get(request, "edit")

						removeButtonValue = languageUtil.get(request, "remove")

						commerceCountry = curCommerceAddress.getCommerceCountry()
					/>

					<h2 style="color:#000"><strong>${curCommerceAddress.getName()}</strong></h2>

					<h3 style="color:#000">${curCommerceAddress.getStreet1()}</h3>

					<h3 style="color:#000">${curCommerceAddress.getZip()}, ${curCommerceAddress.getCity()}</h3>

					<#if commerceCountry??>
						<h3 style="color:#000">${commerceCountry.getName(themeDisplay.getLanguageId())}</h3>
					</#if>

					<div class="row" style="padding-top:30px">
						<@liferay_aui.button
							cssClass="btn-lg"
							href="${editURL}"
							name="editAddressButton"
							value="${editButtonValue}"
						/>

						<@liferay_aui.button
							cssClass="btn-lg"
							href="${deleteURL}"
							name="removeAddressButton"
							value="${removeButtonValue}"
						/>
					</div>
				</div>

				<#assign count = count + 1 />

				<#if count gte 3>
					</div>

					<div class="row" style="padding:15px">

					<#assign count = 0 />
				</#if>
			</#list>
		</#if>
	</div>

	<div class="row" style="padding:50px 0 15px 0">
		<#assign addButtonValue = languageUtil.get(request, "add-address") />

		<@liferay_aui.button
			cssClass="btn-lg btn-primary"
			href="${commerceAddressDisplayContext.getAddCommerceAddressURL()}"
			name="addAddressButton"
			value="${addButtonValue}"
		/>
	</div>
</div>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37710,37631,37601,37607,NULL,'2021-04-25 05:43:40',27708,0,37708,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Pilar</Name><Name language-id="pt_BR">Setas</Name><Name language-id="ja_JP">矢印</Name><Name language-id="fr_FR">Flèches</Name><Name language-id="hu_HU">Nyilak</Name><Name language-id="de_DE">Pfeile</Name><Name language-id="ca_ES">Fletxes</Name><Name language-id="ar_SA">الأسهم</Name><Name language-id="fi_FI">Nuolet</Name><Name language-id="en_US">Arrows</Name><Name language-id="zh_CN">箭头</Name><Name language-id="es_ES">Flechas</Name><Name language-id="nl_NL">Pijlen</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar en länkstig där varje navigeringselement representeras av en pil med titel och länk.</Description><Description language-id="pt_BR">Exibe um caminho de navegação onde cada elemento de navegação é representado por uma seta com seu título e link.</Description><Description language-id="ja_JP">すべてのナビゲーション要素が矢印とタイトル、リンクで表示されるように、パンくずリストを表示します。</Description><Description language-id="fr_FR">Affiche un fil d''Ariane dans lequel chaque élément de navigation est représenté par une flèche avec son propre titre et son propre lien.</Description><Description language-id="hu_HU">Megjelenít egy úrkövetőt, amelyen minden navigációs elemet egy nyíl képvisel címmel és hivatkozással tartalmaz.</Description><Description language-id="de_DE">Zeigt eine Breadcrumbnavigation an, bei der jedes Navigationselement durch einen Pfeil mit seinem Titel und einem Link dargestellt wird.</Description><Description language-id="ca_ES">Mostra una ruta de navegació en què cada element de navegació es representa amb una fletxa amb el seu títol i enllaç.</Description><Description language-id="ar_SA">يعرض مسار تنقل تفصيلي يتم فيه تمثيل كل عنصر تنقل بواسطة سهم به عنوانه ورابطه.</Description><Description language-id="fi_FI">Näyttää murupolun, jossa jokainen navigointielementti näkyy nuolena otsikkoineen ja linkkinä.</Description><Description language-id="en_US">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description><Description language-id="zh_CN">显示一个面包屑导航，其中每一个导航元素都由箭头及其标题和链接表示。</Description><Description language-id="es_ES">Muestra una ruta de navegación donde cada elemento de navegación se representa mediante una flecha con su título y enlace.</Description><Description language-id="nl_NL">Geeft een broodkruimel weer waarin elk navigatie-element voorgesteld wordt door een pijl met een titel en link.</Description></root>',N'ftl',N'<#if entries?has_content>
	<@liferay_util["html-top"]>
		<style>
			.breadcrumb-arrows li {
				background-color: #EFEFEF;
				margin-bottom: 3px;
				overflow: visible;
			}

			.breadcrumb-arrows li + li::before {
				content: none;
			}

			.breadcrumb-arrows li > a {
				border-right: 4px solid #FFF;
				display: block;
				max-width: 100%;
				position: relative;
			}

			.breadcrumb-arrows .entry {
				line-height: 40px;
				overflow: hidden;
				padding-left: 30px;
				padding-right: 7px;
				text-overflow: ellipsis;
				white-space: nowrap;
			}

			.breadcrumb-arrows a::after {
				border-bottom: 20px inset transparent;
				border-left: 20px solid #EFEFEF;
				border-top: 20px inset transparent;
				content: '''';
				height: 0;
				position: absolute;
				right: -20px;
				top: 0;
				width: 0;
				z-index: 2;
			}

			.breadcrumb-arrows li:nth-child(n+2) a::before {
				border-bottom: 20px inset transparent;
				border-left: 20px solid #FFF;
				border-top: 20px inset transparent;
				content: '''';
				height: 0;
				left: 0;
				position: absolute;
				top: 0;
				width: 0;
			}

			.breadcrumb-arrows li:last-child {
				border-bottom-right-radius: 4px;
				border-right-width: 0;
				border-top-right-radius: 4px;
				position: relative;
			}

			.breadcrumb-arrows li:last-child::before {
				border-bottom: 20px inset transparent;
				border-left: 20px solid #FFF;
				border-top: 20px inset transparent;
				content: '''';
				height: 0;
				left: 0;
				position: absolute;
				top: 0;
				width: 0;
			}

			.breadcrumb-arrows li:last-child .entry {
				padding-right: 23px;
			}

			.breadcrumb-arrows li:first-child {
				border-bottom-left-radius: 4px;
				border-top-left-radius: 4px;
			}

			.breadcrumb-arrows li:first-child::before {
				border-left-width: 0;
			}

			.breadcrumb-arrows li:first-child .entry {
				padding-left: 23px;
			}

			.breadcrumb-arrows .active {
				background-color: #007ACC;
			}

			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {
				color: #FFF;
			}

			.breadcrumb-arrows .active a::after {
				border-left-color: #007ACC;
			}

			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {
				border-right-color: #F5F7F8;
			}

			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {
				border-left-color: #F5F7F8;
			}
		</style>
	</@>

	<div class="breadcrumb breadcrumb-arrows">
		<#assign cssClass = "" />

		<#list entries as entry>
			<#if entry?is_last>
				<#assign cssClass = "active" />
			</#if>

			<li class="${cssClass}" <#if entry?is_last>aria-current="page"</#if>>
				<#if entry?has_next>
					<a

					<#if entry.isBrowsable()>
						href="${entry.getURL()!""}"
					</#if>

					>
				</#if>

				<div class="entry">
					${htmlUtil.escape(entry.getTitle())}
				</div>

				<#if entry?has_next>
					</a>
				</#if>
			</li>
		</#list>
	</div>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37713,37631,37601,37607,NULL,'2021-04-25 05:43:40',27708,0,37711,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Horisontell</Name><Name language-id="pt_BR">Horizontal</Name><Name language-id="ja_JP">水平方向</Name><Name language-id="fr_FR">Horizontal(e)</Name><Name language-id="hu_HU">Vízszintes</Name><Name language-id="de_DE">Horizontal</Name><Name language-id="ca_ES">Horitzontal</Name><Name language-id="ar_SA">أفقي</Name><Name language-id="fi_FI">Vaakasuuntainen</Name><Name language-id="en_US">Horizontal</Name><Name language-id="zh_CN">水平</Name><Name language-id="es_ES">Horizontal</Name><Name language-id="nl_NL">Horizontaal</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar en länkstig horisontellt.</Description><Description language-id="pt_BR">Exibe um caminho de navegação horizontalmente.</Description><Description language-id="ja_JP">パンくずリストをを水平方向に表示します</Description><Description language-id="fr_FR">Affiche un fil d''Ariane de manière horizontale.</Description><Description language-id="hu_HU">Megjelenít egy útkövetőjelet vízszintesen.</Description><Description language-id="de_DE">Zeigt eine Breadcrumbnavigation horizontal an.</Description><Description language-id="ca_ES">Mostra una ruta de navegació horitzontalment.</Description><Description language-id="ar_SA">يعرض مسار تنقل أفقيًا.</Description><Description language-id="fi_FI">Näyttää murupolun vaakasuoraan.</Description><Description language-id="en_US">Displays a breadcrumb horizontally.</Description><Description language-id="zh_CN">水平显示面包屑导航。</Description><Description language-id="es_ES">Muestra una ruta de navegación horizontalmente.</Description><Description language-id="nl_NL">Geeft een broodkruimel horizontaal weer.</Description></root>',N'ftl',N'<#if entries?has_content>
	<ol class="breadcrumb">
		<#list entries as entry>
			<li class="breadcrumb-item">
				<#if entry?has_next>
					<a class="breadcrumb-link" href="${entry.getURL()!""}" title="${htmlUtil.escape(entry.getTitle())}">
						<span class="breadcrumb-text-truncate">${htmlUtil.escape(entry.getTitle())}</span>
