	 (0,0,37716,37631,37601,37607,NULL,'2021-04-25 05:43:40',27708,0,37714,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Vertikal</Name><Name language-id="pt_BR">Vertical</Name><Name language-id="ja_JP">垂直方向</Name><Name language-id="fr_FR">Vertical</Name><Name language-id="hu_HU">Függőleges</Name><Name language-id="de_DE">Vertikal</Name><Name language-id="ca_ES">Vertical</Name><Name language-id="ar_SA">رأسي</Name><Name language-id="fi_FI">Pystysuora</Name><Name language-id="en_US">Vertical</Name><Name language-id="zh_CN">垂直</Name><Name language-id="es_ES">Vertical</Name><Name language-id="nl_NL">Verticaal</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar en länkstig vertikalt.</Description><Description language-id="pt_BR">Exibe um caminho de navegação verticalmente.</Description><Description language-id="ja_JP">パンくずリストをを垂直方向に表示します</Description><Description language-id="fr_FR">Affiche un fil d''Ariane vertical.</Description><Description language-id="hu_HU">Megjelenít egy útkövetőjelet függőlegesen.</Description><Description language-id="de_DE">Zeigt eine Breadcrumbnavigation vertikal an.</Description><Description language-id="ca_ES">Mostra una ruta de navegació verticalment.</Description><Description language-id="ar_SA">يعرض مسار تنقل رأسيًا.</Description><Description language-id="fi_FI">Näyttää murupolun pystysuoraan.</Description><Description language-id="en_US">Displays a breadcrumb vertically.</Description><Description language-id="zh_CN">垂直显示面包屑导航。</Description><Description language-id="es_ES">Muestra una ruta de navegación verticalmente.</Description><Description language-id="nl_NL">Geeft een broodkruimel verticaal weer.</Description></root>',N'ftl',N'<#if entries?has_content>
	<ul class="breadcrumb breadcrumb-vertical">
		<#assign cssClass = "" />

		<#list entries as entry>
			<#if entry?is_last>
				<#assign cssClass = "active" />
			</#if>

			<li class="${cssClass}" <#if entry?is_last>aria-current="page"</#if>>
				<#if entry?has_next>
					<a

					<#if entry.isBrowsable()>
						href="${entry.getURL()!""}"
					</#if>

					>
				</#if>

				${htmlUtil.escape(entry.getTitle())}

				<#if entry?has_next>
					</a>
				</#if>
			</li>
		</#list>
	</ul>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37719,37631,37601,37607,NULL,'2021-04-25 05:43:40',27709,0,37717,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Navigering</Name><Name language-id="pt_BR">Navegação</Name><Name language-id="ja_JP">ナビゲーション</Name><Name language-id="fr_FR">Navigation</Name><Name language-id="hu_HU">Navigáció</Name><Name language-id="de_DE">Navigation</Name><Name language-id="ca_ES">Navegació</Name><Name language-id="ar_SA">الملاحة</Name><Name language-id="fi_FI">Navigointi</Name><Name language-id="en_US">Navigation</Name><Name language-id="zh_CN">导航</Name><Name language-id="es_ES">Navegación</Name><Name language-id="nl_NL">Navigatie</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar RSS-flödet som ett navigeringsfält i panelen till vänster. Om du klickar på flödet visas en lista med feedposter i panelen till höger.</Description><Description language-id="pt_BR">Exibe os feeds RSS como uma barra de navegação no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id="ja_JP">RSSフィードを左のパネルにナビゲーションバーとして表示します。フィードをクリックすると、右パネルにフィードの内容がリスト表示されます</Description><Description language-id="fr_FR">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d''entrées de flux sur le panneau droit.</Description><Description language-id="hu_HU">Megjeleníti az RSS hírcsatornákat navigációs oszlopként a bal oldalon. Egy hírcsatornára kattintva megjeleníti a hírcsatorna bejegyzések listáját a jobb oldalon.</Description><Description language-id="de_DE">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeinträge im rechten Bereich dargestellt.</Description><Description language-id="ca_ES">Mostra els canals RSS com una barra de navegació en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d''entrades en el tauler dret.</Description><Description language-id="ar_SA">يعرض موجزات RSS كشريط تنقل في اللوحة اليسرى. إذ يؤدي النقر فوق موجز إلى عرض قائمة بإدخالات الموجزات على اللوحة اليمنى.</Description><Description language-id="fi_FI">Näyttää RSS-syötteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla syötettä näytetään syötteen arvot oikeassa paneelissa.</Description><Description language-id="en_US">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id="zh_CN">在左侧面板上显示RSS源的导航栏。在右侧面板上点击Feed显示提要条目的列表。</Description><Description language-id="es_ES">Muestra las fuentes RSS como una barra de navegación del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id="nl_NL">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description></root>',N'ftl',N'<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />

<style>
	.portlet-rss .feed-entry-content {
		margin-bottom: 20px;
		padding-left: 0;
	}
</style>

<#if entries?has_content>
	<#assign dateFormat = "dd MMM yyyy - HH:mm:ss" />

	<div class="container-fluid">
		<div class="row" id="<@portlet.namespace />feedsTab">
			<ul class="col-xs-4">
				<#list entries as curEntry>
					<li><a href="#tab-${curEntry_index}">${htmlUtil.escape(curEntry.getTitle())}</a></li>
				</#list>
			</ul>

			<div class="col-xs-8 tab-content">
				<#list entries as curEntry>
					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />

					<#if rssFeedEntries??>
						<div class="tab-pane" id="tab-${curEntry_index}">
							<#list rssFeedEntries as rssFeedEntry>
								<#if (rssFeedEntry_index > entriesPerFeed?number)>
									<#break>
								</#if>

								<#assign syndEntry = rssFeedEntry.getSyndEntry() />

								<div class="feed-entry-content">
									<div class="feed-title">
										<@liferay_aui["a"] href="${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}">${htmlUtil.escape(syndEntry.getTitle())}</@>
									</div>

									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>
										<div class="feed-entry-author">
											${htmlUtil.escape(syndEntry.getAuthor())}
										</div>
									</#if>

									<#if syndEntry.getPublishedDate()??>
										<div class="feed-date">
											<@liferay_ui["icon"]
												icon="calendar"
												label=true
												markupView="lexicon"
												message="${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}"
											/>
										</div>
									</#if>

									${rssFeedEntry.getSanitizedContent()}
								</div>
							</#list>
						</div>
					</#if>
				</#list>
			</div>
		</div>
	</div>

	<@liferay_aui["script"] use="aui-base,aui-tabview">
		new A.TabView(
			{
				srcNode: ''#<@portlet.namespace />feedsTab'',
				stacked: true,
				type: ''pills''
			}
		).render();
	</@>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37722,37631,37601,37607,NULL,'2021-04-25 05:43:40',27711,0,37720,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Standard</Name><Name language-id="pt_BR">Básico</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="fr_FR">Basique</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="de_DE">Einfach</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="fi_FI">Perus</Name><Name language-id="en_US">Basic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="es_ES">Básico</Name><Name language-id="nl_NL">Basis</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>',N'ftl',N'<#assign count = 0 />

<#if entries?has_content>
	<div class="row">
		<#assign
			orderPrice = commerceCartContentMiniDisplayContext.getCommerceOrderPrice()

			subTotal = orderPrice.getSubtotal()
		/>

		<div class="col-md-12">
			<strong>Total: ${subTotal.format(themeDisplay.getLocale())}</strong>
		</div>

		<#list entries as curCommerceOrderItem>
			<#assign
				cpDefinition = curCommerceOrderItem.getCPDefinition()

				image = ''''

				productURL = commerceCartContentMiniDisplayContext.getCPDefinitionURL(cpDefinition.getCPDefinitionId(), themeDisplay)

				name = cpDefinition.getName(themeDisplay.getLanguageId())
			/>

			<#if commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)??>
				<#assign
					image = commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)
				/>
			</#if>

			<div class="col-md-6">
				<div class="row-fluid">
					<img class="w-100" src="${image}">
				</div>

				<div class="row-fluid">
					<a href="${productURL}">
						<strong>${name}</strong>
					</a>

					<div class="commerce-price-section d-inline float-right">
						<@liferay_commerce["price"]
							CPDefinitionId=cpDefinition.getCPDefinitionId()
							CPInstanceId=curCommerceOrderItem.getCPInstanceId()
							showDiscount=false
						/>
					</div>
				</div>
			</div>

			<#assign count = count + 1 />

			<#if count gte 2>
				</div>

				<div class="row">

				<#assign count = 0 />
			</#if>
		</#list>
	</div>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
