	 (0,0,37755,37631,37601,37607,NULL,'2021-04-25 05:43:40',20098,0,37753,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Fält i standardstil</Name><Name language-id="pt_BR">Barra estilizada padrão</Name><Name language-id="ja_JP">規定スタイルのバー</Name><Name language-id="fr_FR">Barre par défaut</Name><Name language-id="hu_HU">Alapértelmezett stílusú oszlop</Name><Name language-id="de_DE">Standard-Leiste</Name><Name language-id="ca_ES">Barra amb estil per defecte</Name><Name language-id="ar_SA">شريط افتراضي النمط</Name><Name language-id="fi_FI">Palkki oletustyylillä</Name><Name language-id="en_US">Bar default styled</Name><Name language-id="zh_CN">导航栏默认样式</Name><Name language-id="es_ES">Barra con estilo predeterminado</Name><Name language-id="nl_NL">Standaardbalk</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar en navigeringsmeny med ett navigeringsfält med standardstil.</Description><Description language-id="pt_BR">Exibe um menu de navegação com uma barra de navegação padrão estilizada.</Description><Description language-id="ja_JP">デフォルト形式でナビゲーションメニューを表示します。</Description><Description language-id="fr_FR">Affiche un menu de navigation avec une barre de navigation par défaut.</Description><Description language-id="hu_HU">Megjelenít egy navigációs menüt egy alapértelmezett stílusú navigációs sávval.</Description><Description language-id="de_DE">Zeigt ein Navigationsmenü mit einer Standard-Navigationsleiste an.</Description><Description language-id="ca_ES">Mostra un menú de navegació amb una barra de navegació amb un estil predeterminat.</Description><Description language-id="ar_SA">يعرض قائمة تنقل بشريط تنقل بنمط افتراضي.</Description><Description language-id="fi_FI">Näyttää navigointivalikon oletustyylisellä navigointipalkilla.</Description><Description language-id="en_US">Displays a navigation menu with a default styled navigation bar.</Description><Description language-id="zh_CN">显示带有默认样式导航栏的导航菜单。</Description><Description language-id="es_ES">Muestra un menú de navegación con una barra de navegación con un estilo predeterminado.</Description><Description language-id="nl_NL">Geeft een navigatiemenu weer met een standaard navigatiebalk.</Description></root>',N'ftl',N'<#include "${templatesPath}/NAVIGATION-MACRO-FTL" />

<#if !entries?has_content>
	<#if themeDisplay.isSignedIn()>
		<div class="alert alert-info">
			<@liferay.language key="there-are-no-menu-items-to-display" />
		</div>
	</#if>
<#else>
	<#assign
		portletDisplay = themeDisplay.getPortletDisplay()

		navbarId = "navbar_" + portletDisplay.getId()
	/>

	<div id="${navbarId}">
		<ul aria-label="<@liferay.language key="site-pages" />" class="nav navbar-nav navbar-site" role="menubar">
			<#assign navItems = entries />

			<#list navItems as navItem>
				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />

				<#if navItem.isBrowsable() || showChildrenNavItems>
					<#assign
						nav_item_attr_has_popup = ""
						nav_item_caret = ""
						nav_item_css_class = "lfr-nav-item nav-item"
						nav_item_href_link = ""
						nav_item_link_css_class = "nav-link text-truncate"
					/>

					<#if showChildrenNavItems>
						<#assign
							nav_item_attr_has_popup = "aria-haspopup=''true''"
							nav_item_caret = ''<span class="lfr-nav-child-toggle"><i class="icon-caret-down"></i></span>''
							nav_item_css_class = "${nav_item_css_class} dropdown"
							nav_item_link_css_class = "${nav_item_link_css_class} dropdown-toggle"
						/>
					</#if>

					<#if navItem.isBrowsable()>
						<#assign nav_item_href_link = "href=''${navItem.getURL()}''" />
					</#if>

					<#if navItem.isChildSelected() || navItem.isSelected()>
						<#assign
							nav_item_css_class = "${nav_item_css_class} selected active"
						/>
					</#if>

					<li class="${nav_item_css_class}" id="layout_${portletDisplay.getId()}_${portletDisplay.getId()}_${navItem.getLayoutId()}" role="presentation">
						<a aria-labelledby="layout_${portletDisplay.getId()}_${navItem.getLayoutId()}" ${nav_item_attr_has_popup} class="${nav_item_link_css_class}" ${nav_item_href_link} ${navItem.getTarget()} role="menuitem">
							<span class="text-truncate"><@liferay_theme["layout-icon"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>
						</a>

						<#if showChildrenNavItems>
							<ul aria-expanded="false" class="child-menu dropdown-menu" role="menu">
								<@buildChildrenNavItems
									displayDepth=displayDepth
									navItem=navItem
								/>
							</ul>
						</#if>
					</li>
				</#if>
			</#list>
		</ul>
	</div>

	<@liferay_aui.script use="liferay-navigation-interaction">
		var navigation = A.one(''#${navbarId}'');

		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = ''.navbar-site'';
		Liferay.Data.NAV_LIST_SELECTOR = ''.navbar-site'';

		if (navigation) {
			navigation.plug(Liferay.NavigationInteraction);
		}
	</@>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37758,37631,37601,37607,NULL,'2021-04-25 05:43:40',20098,0,37756,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Navigering i vanliga makron</Name><Name language-id="pt_BR">Macros de navegação comuns</Name><Name language-id="ja_JP">ナビゲーションの一般的なマクロ</Name><Name language-id="fr_FR">Macros de navigation ordinaires</Name><Name language-id="hu_HU">Navigáció közös makrói</Name><Name language-id="de_DE">Navigation häufige Makros</Name><Name language-id="ca_ES">Macros comunes de navegació</Name><Name language-id="ar_SA">وحدات الماكرو الشائعة للتنقل</Name><Name language-id="fi_FI">Navigoinnin yleiset makrot</Name><Name language-id="en_US">Navigation common macros</Name><Name language-id="zh_CN">导航常用宏</Name><Name language-id="es_ES">Macros comunes de navegación</Name><Name language-id="nl_NL">Algemene navigatiemacro''s</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Innehåller vanliga makron för navigeringsmenymallar.</Description><Description language-id="pt_BR">Contém macros comuns para o modelo do menu de navegação.</Description><Description language-id="ja_JP">ナビゲーションメニューテンプレート用のマクロを含みます</Description><Description language-id="fr_FR">Contient les macros ordinaires pour les modèles de menu de navigation.</Description><Description language-id="hu_HU">A navigációs menü sablonok közös makróit tartalmazza.</Description><Description language-id="de_DE">Enthält häufige Makros für Navigationsmenüvorlagen.</Description><Description language-id="ca_ES">Conté macros comunes per a les plantilles del menú de navegació.</Description><Description language-id="ar_SA">يحتوي على وحدات ماكرو شائعة لقوالب قائمة التنقل.</Description><Description language-id="fi_FI">Sisältää yleiset navigointivalikkomallien makrot.</Description><Description language-id="en_US">Contains common macros for navigation menu templates.</Description><Description language-id="zh_CN">包含导航菜单模板的常用宏。</Description><Description language-id="es_ES">Contiene macros comunes para plantillas del menú de navegación.</Description><Description language-id="nl_NL">Bevat algemene macro''s voor navigatiemenusjablonen.</Description></root>',N'ftl',N'<#macro buildChildrenNavItems
	displayDepth
	navItem
	navItemLevel = 2
>
	<#assign
		portletDisplay = themeDisplay.getPortletDisplay()
	/>

	<#list navItem.getChildren() as childNavigationItem>
		<#assign
			nav_child_css_class = ""
		/>

		<#if childNavigationItem.isChildSelected() || childNavigationItem.isSelected()>
			<#assign
				nav_child_css_class = "active selected"
			/>
		</#if>

		<li class="${nav_child_css_class}" id="layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}" role="presentation">
			<#if childNavigationItem.isBrowsable()>
				<a aria-labelledby="layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}" class="dropdown-item" href="${childNavigationItem.getURL()}" ${childNavigationItem.getTarget()} role="menuitem">${childNavigationItem.getName()}</a>
			<#else>
				<span class="dropdown-item font-weight-semi-bold navigation-menu__submenu">${childNavigationItem.getName()}</span>
			</#if>
		</li>

		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>
			<ul class="list-unstyled pl-3">
				<@buildChildrenNavItems
					displayDepth=displayDepth
					navItem=childNavigationItem
					navItemLevel=(navItemLevel + 1)
				/>
			</ul>
		</#if>
	</#list>
</#macro>

<#macro buildNavigation
	branchNavItems
	cssClass
	displayDepth
	includeAllChildNavItems
	navItemLevel
	navItems
>
	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>
		<ul class="${cssClass} level-${navItemLevel}">
			<#list navItems as navItem>
				<#assign
					nav_item_css_class = "lfr-nav-item"
				/>

				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>
					<#assign nav_item_css_class = "${nav_item_css_class} open" />
				</#if>

				<#if navItem.isChildSelected() || navItem.isSelected()>
					<#assign
						nav_item_css_class = "${nav_item_css_class} selected active"
					/>
				</#if>

				<li class="${nav_item_css_class}">
					<#if navItem.isBrowsable()>
						<a class="${nav_item_css_class}" href="${navItem.getRegularURL()!""}" ${navItem.getTarget()}>${navItem.getName()}</a>
					<#else>
						${navItem.getName()}
					</#if>

					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>
						<@buildNavigation
							branchNavItems=branchNavItems
							cssClass=cssClass
							displayDepth=displayDepth
							includeAllChildNavItems=includeAllChildNavItems
							navItemLevel=(navItemLevel + 1)
							navItems=navItem.getChildren()
						/>
					</#if>
				</li>
			</#list>
		</ul>
	</#if>
</#macro>',0,37607,NULL,'2021-04-25 05:43:40');
