	 (0,0,37761,37631,37601,37607,NULL,'2021-04-25 05:43:40',20098,0,37759,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Nedrullningsbara listor med delningsknappar</Name><Name language-id="pt_BR">Dividir menus suspensos de botão</Name><Name language-id="ja_JP">スプリットボタンのドロップダウン</Name><Name language-id="fr_FR">Partager les boutons du menu déroulant</Name><Name language-id="hu_HU">Osztott gomb legördülő elemei</Name><Name language-id="de_DE">Dropdown mit geteilten Schaltflächen</Name><Name language-id="ca_ES">Desplegables de botó de divisió</Name><Name language-id="ar_SA">تقسيم القوائم المنسدلة للأزرار</Name><Name language-id="fi_FI">Jakopainikkeen Pudotusvalikot</Name><Name language-id="en_US">Split Button Dropdowns</Name><Name language-id="zh_CN">拆分按钮下拉菜单</Name><Name language-id="es_ES">Desplegables de botón de expansión</Name><Name language-id="nl_NL">Rolmenu met uitgesplitste knoppen</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar en nedrullningsbar navigeringsmeny med rotmenyobjekt som visas som knappar.</Description><Description language-id="pt_BR">Exibe um menu de navegação suspenso com itens do menu raiz mostrados como botões.</Description><Description language-id="ja_JP">ボタン形式のドロップダウンでナビゲーション メニューを表示します。</Description><Description language-id="fr_FR">Affiche un menu de navigation déroulant dont les éléments sont affichés sous la forme de boutons.</Description><Description language-id="hu_HU">Megjelenít egy lenyíló navigációs menüt, amelyben a gyökérszintű menüpontok gombokként jelennek meg.</Description><Description language-id="de_DE">Zeigt ein Dropdown-Navigationsmenü mit Root-Menüelementen als Schaltflächen an.</Description><Description language-id="ca_ES">Mostra un menú de navegació desplegable els elements de menú arrel que es mostren com a botons.</Description><Description language-id="ar_SA">يعرض قائمة تنقل منسدلة تحتوي على عناصر قائمة جذر تظهر كأزرار.</Description><Description language-id="fi_FI">Näyttää pudotusnavigointivalikon juurivalikon kohdat esitettynä painikkeina.</Description><Description language-id="en_US">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id="zh_CN">显示下拉式导航菜单，其中根菜单项显示为按钮。</Description><Description language-id="es_ES">Muestra un menú de navegación desplegable con elementos de menú raíz que se muestran como botones.</Description><Description language-id="nl_NL">Geeft een rolmenu voor navigatie weer met rootmenu-items in de vorm van knoppen.</Description></root>',N'ftl',N'<#include "${templatesPath}/NAVIGATION-MACRO-FTL" />

