	 (0,0,37773,37631,37601,37607,NULL,'2021-04-25 05:43:40',27716,0,37771,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Ikonmeny</Name><Name language-id="pt_BR">Menu de ícones</Name><Name language-id="ja_JP">アイコン メニュー</Name><Name language-id="fr_FR">Menu d''icônes</Name><Name language-id="hu_HU">Ikon menü</Name><Name language-id="de_DE">Symbolmenü</Name><Name language-id="ca_ES">Menú d''icones</Name><Name language-id="ar_SA">قائمة أيقونات</Name><Name language-id="fi_FI">Kuvakevalikko</Name><Name language-id="en_US">Icon Menu</Name><Name language-id="zh_CN">图标菜单</Name><Name language-id="es_ES">Menú de icono</Name><Name language-id="nl_NL">Pictogrammenu</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar en ikonmeny med de valda språken.</Description><Description language-id="pt_BR">Exibe um menu de ícone com os idiomas selecionados.</Description><Description language-id="ja_JP">選択した言語のアイコンメニューを表示します。</Description><Description language-id="fr_FR">Affiche un menu d''icônes avec les langues sélectionnées.</Description><Description language-id="hu_HU">Megjelenít egy ikonmenüt a kiválasztott nyelvekkel.</Description><Description language-id="de_DE">Zeigt ein Symbolmenü mit den ausgewählten Sprachen.</Description><Description language-id="ca_ES">Mostra una icona de menú amb els idiomes seleccionats.</Description><Description language-id="ar_SA">يعرض قائمة الأيقونات باللغات المحددة.</Description><Description language-id="fi_FI">Näyttää valittuihin kieliin liittyvän kuvakevalikon.</Description><Description language-id="en_US">Displays an icon menu with the selected languages.</Description><Description language-id="zh_CN">显示带有选定语言的图标菜单。</Description><Description language-id="es_ES">Muestra un menú de icono con los idiomas seleccionados.</Description><Description language-id="nl_NL">Geeft een pictogrammenu weer met de geselecteerde talen.</Description></root>',N'ftl',N'<#if entries?has_content>
	<#assign normalizedDefaultLanguageId = stringUtil.replace(languageId, "_", "-") />

