	 (0,0,37815,37631,37601,37607,NULL,'2021-04-25 05:43:40',27722,0,37813,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Layout för vänsterjusterad ikon</Name><Name language-id="pt_BR">Layout do Ícone Alinhado à Esquerda</Name><Name language-id="ja_JP">左揃えのアイコンレイアウト</Name><Name language-id="fr_FR">Disposition icône alignée à gauche</Name><Name language-id="hu_HU">Elrendezés balra igazított ikonnal</Name><Name language-id="de_DE">Links ausgerichtetes Symbollayout</Name><Name language-id="ca_ES">Disposició de la icona alineada a l''esquerra</Name><Name language-id="ar_SA">مخطط رموز تمت محاذاتها لليسار</Name><Name language-id="fi_FI">Vasemmalle Tasattu Kuvakkeiden Asettelu</Name><Name language-id="en_US">Left Aligned Icon Layout</Name><Name language-id="zh_CN">左对齐图标布局</Name><Name language-id="es_ES">Diseño de icono alineado a la izquierda</Name><Name language-id="nl_NL">Lay-out met pictogram links uitgelijnd</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visa sökikonen till vänster.</Description><Description language-id="pt_BR">Exibir o ícone de busca à esquerda.</Description><Description language-id="ja_JP">検索アイコンを左側に表示します。</Description><Description language-id="fr_FR">Afficher l''icône de recherche sur la gauche.</Description><Description language-id="hu_HU">Jelenítse meg a keresés ikonját a bal oldalon.</Description><Description language-id="de_DE">Such-Symbol links anzeigen.</Description><Description language-id="ca_ES">Mostra la icona de cerca a l''esquerra.</Description><Description language-id="ar_SA">عرض رمز البحث على اليسار.</Description><Description language-id="fi_FI">Näytä hakukuvake vasemmalla.</Description><Description language-id="en_US">Display the search icon on the left.</Description><Description language-id="zh_CN">在左侧显示搜索图标。</Description><Description language-id="es_ES">Muestra el icono de buscar en la parte izquierda.</Description><Description language-id="nl_NL">Het zoekpictogram links weergeven.</Description></root>',N'ftl',N'<@liferay_aui.fieldset cssClass="search-bar">
