	 (0,0,37857,37631,37601,37607,NULL,'2021-04-25 05:43:40',20004,0,37855,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Layout med flera kolumner</Name><Name language-id="pt_BR">Layout em Múltiplas Colunas</Name><Name language-id="ja_JP">複数カラムレイアウト</Name><Name language-id="fr_FR">Mise en page multi-colonne</Name><Name language-id="hu_HU">Több oszlopos elrendezés</Name><Name language-id="de_DE">Multi-Spalten-Layout</Name><Name language-id="ca_ES">Plana multi-columna</Name><Name language-id="ar_SA">تخطيط أعمدة متعددة</Name><Name language-id="fi_FI">Usean sarakkeen asettelu</Name><Name language-id="en_US">Multi Column Layout</Name><Name language-id="zh_CN">多列布局</Name><Name language-id="es_ES">Diseño con varias columnas</Name><Name language-id="nl_NL">Lay-out met meerdere kolommen</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar en kolumn för varje ordlista. Varje kolumn inkluderar namnet på en ordlista med ordlistans toppnivåkategorier listade under.</Description><Description language-id="pt_BR">Exibe uma coluna para cada vocabulário. Cada coluna inclui o nome do vocabulário com as categorias de nível mais alto listadas abaixo dele.</Description><Description language-id="ja_JP">各ボキャブラリ用に列を表示する。各列は以下にリストになっている、最上位に設定されている用語名を含んでいます</Description><Description language-id="fr_FR">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d''un vocabulaire avec les catégories du niveau racine listées en dessous.</Description><Description language-id="hu_HU">Megjelenít egy oszlopot minden szótár számára. Minden oszlop tartalmazza a szótár nevét, alatta a szótár felső szintű kategóriáival.</Description><Description language-id="de_DE">Stellt eine Spalte für jedes Vokabular dar. Jede Spalte enthält den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id="ca_ES">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell més alta a sota.</Description><Description language-id="ar_SA">يعرض عمودًا لكل مفرد. يتضمن كل عمود اسم المفرد مع فئات المستوى الأعلى للمفردات المدرجة تحتها.</Description><Description language-id="fi_FI">Näyttää sarakkeen jokaiselle sanastolle. Jokainen sarake sisältää sanaston nimen, missä sanaston ylätason luokitukset on listattu.</Description><Description language-id="en_US">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary''s top level categories listed underneath.</Description><Description language-id="zh_CN">显示一列中的每个词汇，每列包括顶级类别之下的词汇名字。</Description><Description language-id="es_ES">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categorías de mayor nivel del vocabulario listadas debajo.</Description><Description language-id="nl_NL">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorieën eronder.</Description></root>',N'ftl',N'<#assign hasCategories = false />

<#if entries?has_content>
	<@liferay_aui.row>
		<#list entries as entry>
			<#assign categories = entry.getCategories() />

			<#if categories?has_content>
				<#assign hasCategories = true />

				<@liferay_aui.col width=25>
					<div class="results-header">
						<h3>
							${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}
						</h3>
					</div>

					<@displayCategories categories=categories />
				</@liferay_aui.col>
			</#if>
		</#list>

		<#if !hasCategories>
			${renderRequest.setAttribute("PORTLET_CONFIGURATOR_VISIBILITY", true)}

			<div class="alert alert-info w-100">
				<@liferay_ui.message key="there-are-no-categories" />
			</div>
		</#if>
	</@liferay_aui.row>
</#if>

<#macro displayCategories
	categories
>
	<#if categories?has_content>
		<ul class="categories">
			<#list categories as category>
				<li>
					<#assign categoryURL = renderResponse.createRenderURL() />

					${categoryURL.setParameter("resetCur", "true")}
					${categoryURL.setParameter("categoryId", category.getCategoryId()?string)}

					<a href="${categoryURL}">${category.getName()}</a>

					<#if serviceLocator??>
						<#assign
							assetCategoryService = serviceLocator.findService("com.liferay.asset.kernel.service.AssetCategoryService")

							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())
						/>

						<@displayCategories categories=childCategories />
					</#if>
				</li>
			</#list>
		</ul>
	</#if>
</#macro>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37860,37631,37601,37607,NULL,'2021-04-25 05:43:40',22602,0,37858,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Sociala nätverk</Name><Name language-id="pt_BR">Social</Name><Name language-id="ja_JP">ソーシャル</Name><Name language-id="fr_FR">Social</Name><Name language-id="hu_HU">Közösségi</Name><Name language-id="de_DE">Social</Name><Name language-id="ca_ES">Social</Name><Name language-id="ar_SA">اجتماعي</Name><Name language-id="fi_FI">Sosiaalinen</Name><Name language-id="en_US">Social</Name><Name language-id="zh_CN">社交</Name><Name language-id="es_ES">Social</Name><Name language-id="nl_NL">Sociaal</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar sociala bokmärken och omdömen för wiki-sidor och deras underordnade sidor.</Description><Description language-id="pt_BR">Exibe marcadores sociais e avaliações para páginas da wiki e suas páginas filhas.</Description><Description language-id="ja_JP">Wikiページとそのサブページ用のソーシャルブックマークと評価を表示する</Description><Description language-id="fr_FR">Affiche les signets sociaux and les notations pour page wiki et leur pages enfants.</Description><Description language-id="hu_HU">Megjeleníti a közösségi könyvjelzőket és értékeléseket a wiki oldalak és gyermek oldalaik részére.</Description><Description language-id="de_DE">Darstellung für Social Bookmarks und Bewertungen von Wikiseiten und deren Unterseiten.</Description><Description language-id="ca_ES">Mostra adreces d''interès socials i classificacions per a planes del wiki.</Description><Description language-id="ar_SA">يعرض إشارات مرجعية اجتماعية وتقييمات لصفحات ويكي وصفحاتها الفرعية.</Description><Description language-id="fi_FI">Näyttää sosiaaliset kirjanmerkit ja arvostelut wikisivuilla ja niiden alisivuilla.</Description><Description language-id="en_US">Displays social bookmarks and ratings for wiki pages and their child pages.</Description><Description language-id="zh_CN">显示社交书签和维基页的评分和它们的子页。</Description><Description language-id="es_ES">Muestra los marcadores sociales y las clasificaciones para páginas wiki y sus páginas secundarias.</Description><Description language-id="nl_NL">Geeft sociale favorieten en waarderingen van wikipagina''s en onderliggende wikipagina''s weer.</Description></root>',N'ftl',N'<#assign
	wikiPageClassName = "com.liferay.wiki.model.WikiPage"

	assetRenderer = assetEntry.getAssetRenderer()
/>

<div class="taglib-header">
	<h1 class="header-title">${entry.getTitle()}</h1>
</div>

<div style="float: right;">
	<@getEditIcon />

	<@getPageDetailsIcon />

	<@getPrintIcon />
</div>

<div class="wiki-body">
	<div class="wiki-info">
		<span class="stats">${assetEntry.getViewCount()} <@liferay.language key="views" /></span> |

		<span class="date"><@liferay.language key="last-modified" /> ${dateUtil.getDate(entry.getModifiedDate(), "dd MMM yyyy - HH:mm:ss", locale)}</span>

		<span class="author"><@liferay.language key="by" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}</span>
	</div>

	<div class="wiki-content">
		<@liferay_social_bookmarks["bookmarks"]
			className=wikiPageClassName
			classPK=entry.getResourcePrimKey()
			displayStyle="normal"
			target="_blank"
			title=entry.getTitle()
			url=viewURL
		/>

		${formattedContent}
	</div>

	<div class="page-actions">
		<div class="article-actions">
			<@getAddChildPageIcon />

			<@getAttatchmentsIcon />
		</div>
	</div>

	 <br />

	<@getRatings
		cssClass="page-ratings"
		entry=entry
	/>

	<@getRelatedAssets />
</div>

<div class="page-categorization">
	<div class="page-categories">
		<#assign viewCategorizedPagesURL = renderResponse.createRenderURL() />

		${viewCategorizedPagesURL.setParameter("mvcRenderCommandName", "/wiki/view_categorized_pages")}
		${viewCategorizedPagesURL.setParameter("nodeId", entry.getNodeId()?string)}

		<@liferay_ui["asset-categories-summary"]
			className=wikiPageClassName
			classPK=entry.getResourcePrimKey()
			portletURL=viewCategorizedPagesURL
		/>
	</div>

	<div class="page-tags">
		<#assign viewTaggedPagesURL = renderResponse.createRenderURL() />

		${viewTaggedPagesURL.setParameter("mvcRenderCommandName", "/wiki/view_tagged_pages")}
		${viewTaggedPagesURL.setParameter("nodeId", entry.getNodeId()?string)}

		<@liferay_ui["asset-tags-summary"]
			className=wikiPageClassName
			classPK=entry.getResourcePrimKey()
			portletURL=viewTaggedPagesURL
		/>
	</div>
</div>

<#assign childPages = entry.getChildPages() />

<#if (childPages?has_content)>
	<div class="child-pages">
		<h2><@liferay.language key="children-pages" /></h2>

		<table class="taglib-search-iterator">
			<tr class="portlet-section-header results-header">
				<th>
					<@liferay.language key="page" />
				</th>
				<th>
					<@liferay.language key="last-modified" />
				</th>
				<th>
					<@liferay.language key="ratings" />
				</th>
			</tr>

			<#list childPages as childPage>
				<tr class="results-row">
					<#assign viewPageURL = renderResponse.createRenderURL() />

					${viewPageURL.setParameter("mvcRenderCommandName", "/wiki/view")}

					<#assign childNode = childPage.getNode() />

					${viewPageURL.setParameter("nodeName", childNode.getName())}
					${viewPageURL.setParameter("title", childPage.getTitle())}

					<td>
						<a href="${viewPageURL}">${childPage.getTitle()}</a>
					</td>
					<td>
						<a href="${viewPageURL}">${dateUtil.getDate(childPage.getModifiedDate(),"dd MMM yyyy - HH:mm:ss", locale)} <@liferay.language key="by" /> ${htmlUtil.escape(portalUtil.getUserName(childPage.getUserId(), childPage.getUserName()))}</a>
					</td>
					<td>
						<@getRatings
							cssClass="child-ratings"
							entry=childPage
						/>
					</td>
				</tr>
			</#list>
		</table>
	</div>
</#if>

<@getDiscussion />

<#macro getAddChildPageIcon>
	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>
		<#assign addPageURL = renderResponse.createRenderURL() />

		${addPageURL.setParameter("mvcRenderCommandName", "/wiki/edit_page")}
		${addPageURL.setParameter("redirect", currentURL)}
		${addPageURL.setParameter("nodeId", entry.getNodeId()?string)}
		${addPageURL.setParameter("title", "")}
		${addPageURL.setParameter("editTitle", "1")}
		${addPageURL.setParameter("parentTitle", entry.getTitle())}

		<@liferay_ui["icon"]
			icon="plus"
			label=true
			markupView="lexicon"
			message="add-child-page"
			url=addPageURL?string
		/>
	</#if>
</#macro>

<#macro getAttatchmentsIcon>
	<#assign viewPageAttachmentsURL = renderResponse.createRenderURL() />

	${viewPageAttachmentsURL.setParameter("mvcRenderCommandName", "/wiki/view_page_attachments") }

	<@liferay_ui["icon"]
		icon="paperclip"
		label=true
		markupView="lexicon"
		message=''${entry.getAttachmentsFileEntriesCount() + languageUtil.get(locale, "attachments")}''
		url=viewPageAttachmentsURL?string
	/>
</#macro>

<#macro getDiscussion>
	<#if validator.isNotNull(assetRenderer.getDiscussionPath()) && wikiPortletInstanceConfiguration.enableComments()>
		<br />

		<@liferay_comment["discussion"]
			className=wikiPageClassName
			classPK=entry.getResourcePrimKey()
			ratingsEnabled=wikiPortletInstanceConfiguration.enableCommentRatings()
			redirect=currentURL
			subject=assetRenderer.getTitle(locale)
			userId=assetRenderer.getUserId()
		/>
	</#if>
</#macro>

<#macro getEditIcon>
	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>
		<#assign editPageURL = renderResponse.createRenderURL() />

		${editPageURL.setParameter("mvcRenderCommandName", "/wiki/edit_page")}
		${editPageURL.setParameter("redirect", currentURL)}
		${editPageURL.setParameter("nodeId", entry.getNodeId()?string)}
		${editPageURL.setParameter("title", entry.getTitle())}

		<@liferay_ui["icon"]
			icon="pencil"
			markupView="lexicon"
			message=entry.getTitle()
			url=editPageURL?string
		/>
	</#if>
</#macro>

<#macro getPageDetailsIcon>
	<#assign viewPageDetailsURL = renderResponse.createRenderURL() />

	${viewPageDetailsURL.setParameter("mvcRenderCommandName", "/wiki/view_page_details")}
	${viewPageDetailsURL.setParameter("redirect", currentURL)}

	<@liferay_ui["icon"]
		icon="document"
		markupView="lexicon"
		message="details"
		url=viewPageDetailsURL?string
	/>
</#macro>

<#macro getPrintIcon>
	<#assign printURL = renderResponse.createRenderURL() />

	${printURL.setParameter("viewMode", "print")}
	${printURL.setWindowState("pop_up")}

	<#assign
		title = languageUtil.format(locale, "print-x-x", ["hide-accessible", htmlUtil.escape(assetRenderer.getTitle(locale))], false)
		taglibPrintURL = "javascript:Liferay.Util.openWindow({dialog: {width: 960}, id:''" + renderResponse.getNamespace() + "printAsset'', title: ''" + title + "'', uri: ''" + htmlUtil.escapeURL(printURL.toString()) + "''});"
	/>

	<@liferay_ui["icon"]
		icon="print"
		markupView="lexicon"
		message="print"
		url=taglibPrintURL
	/>
</#macro>

<#macro getRatings
	cssClass
	entry
>
	<#if wikiPortletInstanceConfiguration.enablePageRatings()>
		<div class="${cssClass}">
			<@liferay_ui["ratings"]
				className=wikiPageClassName
				classPK=entry.getResourcePrimKey()
			/>
		</div>
	</#if>
</#macro>

<#macro getRelatedAssets>
	<#if assetEntry?? && wikiPortletInstanceConfiguration.enableRelatedAssets()>
		<@liferay_asset["asset-links"] assetEntryId=assetEntry.getEntryId() />
	</#if>
</#macro>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37863,37631,37601,37607,NULL,'2021-04-25 05:43:40',27301,0,37861,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Standard</Name><Name language-id="pt_BR">Básico</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="fr_FR">Basique</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="de_DE">Einfach</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="fi_FI">Perus</Name><Name language-id="en_US">Basic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="es_ES">Básico</Name><Name language-id="nl_NL">Basis</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>',N'ftl',N'<div class="widget-mode-simple">
	<#if entries?has_content>
		<#list entries as curBlogEntry>
			<div class="widget-mode-simple-entry">
				<div class="autofit-row widget-topbar">
