								title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)
								types=blogsPortletInstanceConfiguration.socialBookmarksTypes()
								url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())
							/>
						</div>
					</div>
				</div>
			</div>
		</#list>
	</#if>
</div>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37866,37631,37601,37607,NULL,'2021-04-25 05:43:40',27301,0,37864,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Kort</Name><Name language-id="pt_BR">Cartão</Name><Name language-id="ja_JP">カード</Name><Name language-id="fr_FR">Carte</Name><Name language-id="hu_HU">Kártya</Name><Name language-id="de_DE">Karte</Name><Name language-id="ca_ES">Targeta</Name><Name language-id="ar_SA">البطاقة</Name><Name language-id="fi_FI">Kortti</Name><Name language-id="en_US">Card</Name><Name language-id="zh_CN">卡片</Name><Name language-id="es_ES">Tarjeta</Name><Name language-id="nl_NL">Kaart</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visa omslagsbilder, rubriker, författare och sammanfattningar genom att använda kort för blogginlägg.</Description><Description language-id="pt_BR">Exibir imagens da cobertura, títulos, autores e resumos usando cartões para entradas do blog.</Description><Description language-id="ja_JP">ブログ エントリを表紙の画像、タイトル、著者と要約をカード形式で表示します</Description><Description language-id="fr_FR">Afficher dans les entrées de blog les images de couvertures, les titres, les auteurs et les résumés en utilisant des cartes.</Description><Description language-id="hu_HU">Borítóképek, címek, szerzők és absztraktok megjelenítése blogbejegyzések kártyái segítségével.</Description><Description language-id="de_DE">Zeigen Sie Coverbilder, Titel, Autoren und Kurzfassungen mit Karten für Blog-Einträge an.</Description><Description language-id="ca_ES">Mostra imatges de portada, títols, autors i resums amb targetes per a les entrades del blog.</Description><Description language-id="ar_SA">اعرض صور الأغلفة والعناوين والمؤلفين والملخصات باستخدام البطاقات الخاصة بإدخالات المدونات.</Description><Description language-id="fi_FI">Näyttö kattaa kuvat, otsikot, tekijät ja abstraktit käyttäen kortteja blogientryille.</Description><Description language-id="en_US">Display cover images, titles, authors and abstracts using cards for blog entries.</Description><Description language-id="zh_CN">使用卡片为博客条目显示封面、标题、作者和摘要。</Description><Description language-id="es_ES">Muestra imágenes de portada, títulos, autores y abstractos con tarjetas de entradas de blog.</Description><Description language-id="nl_NL">Toon cover-afbeeldingen, titels, auteurs en samenvattingen m. b. v. kaarten voor blogberichten.</Description></root>',N'ftl',N'<div class="row widget-mode-card">
	<#if entries?has_content>
		<#list entries as curBlogEntry>
			<#if curBlogEntry.getCoverImageURL(themeDisplay)??>
				<#assign cardImage = true />
			<#else>
				<#assign cardImage = false />
			</#if>

			<div class="col-lg-4">
				<div class="card">
					<div class="card-header">
						<div class="aspect-ratio aspect-ratio-8-to-3">
							<img alt="thumbnail" class="aspect-ratio-item-center-middle aspect-ratio-item-fluid" src="${cardImage?then(curBlogEntry.getCoverImageURL(themeDisplay), portalUtil.getPathContext(renderRequest) + "/images/cover_image_placeholder.jpg")}">
						</div>
					</div>

					<div class="card-body widget-topbar">
						<div class="autofit-row card-title">
								<div class="autofit-col autofit-col-expand">
									<#assign viewEntryPortletURL = renderResponse.createRenderURL() />

									${viewEntryPortletURL.setParameter("mvcRenderCommandName", "/blogs/view_entry")}
									${viewEntryPortletURL.setParameter("redirect", currentURL)}

									<#if validator.isNotNull(curBlogEntry.getUrlTitle())>
										${viewEntryPortletURL.setParameter("urlTitle", curBlogEntry.getUrlTitle())}
									<#else>
										${viewEntryPortletURL.setParameter("entryId", curBlogEntry.getEntryId()?string)}
									</#if>

									<h3 class="title">
										<a class="title-link" href="${viewEntryPortletURL.toString()}">
										${htmlUtil.escape(blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry))}</a>
									</h3>
								</div>

								<div class="autofit-col visible-interaction">
									<div class="dropdown dropdown-action">
										<@liferay_ui["icon-menu"]
											direction="left-side"
											icon=""
											markupView="lexicon"
											message="actions"
											showWhenSingleIcon=true
										>
											<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, "UPDATE")>
												<#assign editEntryPortletURL = renderResponse.createRenderURL() />

												${editEntryPortletURL.setWindowState(windowStateFactory.getWindowState("MAXIMIZED"))}
												${editEntryPortletURL.setParameter("mvcRenderCommandName", "/blogs/edit_entry")}
												${editEntryPortletURL.setParameter("redirect", currentURL)}
												${editEntryPortletURL.setParameter("entryId", curBlogEntry.getEntryId()?string)}

												<@liferay_ui["icon"]
													label=true
													message="edit"
													url=editEntryPortletURL.toString()
												/>
											</#if>
											<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, "PERMISSIONS")>
												<#assign permissionsEntryURL = permissionsURLTag.doTag(null, "com.liferay.blogs.model.BlogsEntry", blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry), curBlogEntry.getGroupId()?string, curBlogEntry.getEntryId()?string, windowStateFactory.getWindowState("POP_UP").toString(), null, request) />

												<@liferay_ui["icon"]
													label=true
													message="permissions"
													method="get"
													url=permissionsEntryURL
													useDialog=true
												/>
											</#if>
											<#if blogsEntryPermission.contains(permissionChecker, curBlogEntry, "DELETE")>
												<#assign deleteEntryPortletURL = renderResponse.createActionURL() />

												${deleteEntryPortletURL.setParameter("javax.portlet.action", "/blogs/edit_entry")}
												${deleteEntryPortletURL.setParameter("cmd", trashHelper.isTrashEnabled(themeDisplay.getScopeGroupId())?then("move_to_trash", "delete"))}
												${deleteEntryPortletURL.setParameter("redirect", currentURL)}
												${deleteEntryPortletURL.setParameter("entryId", curBlogEntry.getEntryId()?string)}

												<@liferay_ui["icon-delete"]
													label=true
													trash=trashHelper.isTrashEnabled(themeDisplay.getScopeGroupId())
													url=deleteEntryPortletURL.toString()
												/>
											</#if>
										</@>
									</div>
								</div>
						</div>

						<div class="autofit-row widget-metadata">
							<div class="autofit-col inline-item-before">
								<@liferay_ui["user-portrait"]
									size="lg"
									userId=curBlogEntry.userId
									userName=curBlogEntry.userName
								/>
							</div>

							<div class="autofit-col autofit-col-expand">
								<div class="autofit-row">
									<div class="autofit-col autofit-col-expand">
										<#if serviceLocator??>
											<#assign
												userLocalService = serviceLocator.findService("com.liferay.portal.kernel.service.UserLocalService")

												entryUser = userLocalService.fetchUser(curBlogEntry.getUserId())
											/>

											<#if entryUser?? && !entryUser.isDefaultUser()>
												<#assign entryUserURL = entryUser.getDisplayURL(themeDisplay) />
											</#if>
										</#if>

										<div class="text-truncate-inline">
											<a href="${(entryUserURL?? && validator.isNotNull(entryUserURL))?then(entryUserURL, "")}" class="text-truncate username">${curBlogEntry.getUserName()}</a>
										</div>

										<div>
											${dateUtil.getDate(curBlogEntry.getStatusDate(), "dd MMM", locale)}

											<#if blogsPortletInstanceConfiguration.enableReadingTime()>
												- <@liferay_reading_time["reading-time"] displayStyle="simple" model=curBlogEntry />
											</#if>

											<#if serviceLocator??>
												<#assign
													assetEntryLocalService = serviceLocator.findService("com.liferay.asset.kernel.service.AssetEntryLocalService")

													assetEntry = assetEntryLocalService.getEntry("com.liferay.blogs.model.BlogsEntry", curBlogEntry.getEntryId())
												/>

												<#if blogsPortletInstanceConfiguration.enableViewCount()>
													- <@liferay_ui["message"] arguments=assetEntry.getViewCount() key=(assetEntry.getViewCount()==0)?then("x-view", "x-views") />
												</#if>
											</#if>
										</div>
									</div>
								</div>
							</div>
						</div>

						<#if validator.isNotNull(curBlogEntry.getDescription())>
							<#assign content = curBlogEntry.getDescription() />
						<#else>
							<#assign content = curBlogEntry.getContent() />
						</#if>

						<#if cardImage>
							<p class="widget-resume">${stringUtil.shorten(htmlUtil.stripHtml(content), 150)}</p>
						<#else>
							<p class="widget-resume">${stringUtil.shorten(htmlUtil.stripHtml(content), 400)}</p>
						</#if>
					</div>

					<div class="card-footer">
						<div class="autofit-float autofit-row autofit-row-center widget-toolbar">
							<#if blogsPortletInstanceConfiguration.enableComments()>
								<div class="autofit-col">
									<#assign viewCommentsPortletURL = renderResponse.createRenderURL() />

									${viewCommentsPortletURL.setParameter("mvcRenderCommandName", "/blogs/view_entry")}
									${viewCommentsPortletURL.setParameter("scroll", renderResponse.getNamespace() + "discussionContainer")}

									<#if validator.isNotNull(curBlogEntry.getUrlTitle())>
										${viewCommentsPortletURL.setParameter("urlTitle", curBlogEntry.getUrlTitle())}
									<#else>
										${viewCommentsPortletURL.setParameter("entryId", curBlogEntry.getEntryId()?string)}
									</#if>

									<a class="btn btn-outline-borderless btn-outline-secondary btn-sm" href="${viewCommentsPortletURL.toString()}" title="${language.get(locale, "comments")}">
										<span class="inline-item inline-item-before">
											<@clay["icon"] symbol="comments" />
										</span> ${commentManager.getCommentsCount("com.liferay.blogs.model.BlogsEntry", curBlogEntry.getEntryId())}
									</a>
								</div>
							</#if>

							<#if blogsPortletInstanceConfiguration.enableRatings()>
								<div class="autofit-col">
									<@liferay_ui["ratings"]
										className="com.liferay.blogs.model.BlogsEntry"
										classPK=curBlogEntry.getEntryId()
									/>
								</div>
							</#if>

							<div class="autofit-col autofit-col-end">
								<#assign bookmarkURL = renderResponse.createRenderURL() />

								${bookmarkURL.setWindowState(windowStateFactory.getWindowState("NORMAL"))}
								${bookmarkURL.setParameter("mvcRenderCommandName", "/blogs/view_entry")}

								<#if validator.isNotNull(curBlogEntry.getUrlTitle())>
									${bookmarkURL.setParameter("urlTitle", curBlogEntry.getUrlTitle())}
								<#else>
									${bookmarkURL.setParameter("entryId", curBlogEntry.getEntryId()?string)}
								</#if>

								<@liferay_social_bookmarks["bookmarks"]
									className="com.liferay.blogs.model.BlogsEntry"
									classPK=curBlogEntry.getEntryId()
									maxInlineItems=0
									target="_blank"
									title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)
									types=blogsPortletInstanceConfiguration.socialBookmarksTypes()
									url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())
								/>
							</div>
						</div>
					</div>
				</div>
			</div>
		</#list>
	</#if>
</div>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,37873,37631,37601,37607,NULL,'2021-04-25 05:43:41',20006,0,37871,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Kartor</Name><Name language-id="pt_BR">Mapa</Name><Name language-id="ja_JP">マッピング</Name><Name language-id="fr_FR">Carte</Name><Name language-id="hu_HU">Térkép</Name><Name language-id="de_DE">Landkarte</Name><Name language-id="ca_ES">Mapa</Name><Name language-id="ar_SA">الخريطه</Name><Name language-id="fi_FI">Kartta</Name><Name language-id="en_US">Map</Name><Name language-id="zh_CN">映射</Name><Name language-id="es_ES">Mapa</Name><Name language-id="nl_NL">Kaart</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar geolokaliserade tillgångar på en karta.</Description><Description language-id="pt_BR">Exibe os conteúdos geolocalizados em um mapa.</Description><Description language-id="ja_JP">地図内にジオローカライズされたアセットを表示する</Description><Description language-id="fr_FR">Affiche les assets géolocalisés dans un plan</Description><Description language-id="hu_HU">Megjeleníti a földrajzi tartalmakat egy térképen.</Description><Description language-id="de_DE">Stellt Assets mit geografischen Informationen in einer Karte dar.</Description><Description language-id="ca_ES">Mostra contingut geolocalitzat en un mapa.</Description><Description language-id="ar_SA">يعرض الأصول الجيوجغرافية في خريطة.</Description><Description language-id="fi_FI">Näyttää maantieteelliset sisällöt kartalla.</Description><Description language-id="en_US">Displays geolocalized assets in a map.</Description><Description language-id="zh_CN">显示在地图上定位的资源</Description><Description language-id="es_ES">Muestra activos geolocalizados en un mapa.</Description><Description language-id="nl_NL">Toon geolocale content op een kaart.</Description></root>',N'ftl',N'<#assign
	defaultLatitude = -3.6833
	defaultLongitude = 40.40

	group = themeDisplay.getScopeGroup()

	mapsAPIProvider = group.getLiveParentTypeSettingsProperty("mapsAPIProvider")!""

	companyPortletPreferences = prefsPropsUtil.getPreferences(companyId)
/>

<#if validator.isNull(mapsAPIProvider)>
	<#assign mapsAPIProvider = companyPortletPreferences.getValue("mapsAPIProvider", "Google") />
</#if>

<#assign featureCollectionJSONObject = jsonFactoryUtil.createJSONObject() />

<@liferay.silently featureCollectionJSONObject.put("type", "FeatureCollection") />

<#assign featureJSONArray = jsonFactoryUtil.createJSONArray() />

<#list entries as entry>
	<#assign
		assetRenderer = entry.getAssetRenderer()

		ddmFormValuesReader = assetRenderer.getDDMFormValuesReader()

		ddmFormFieldValues = ddmFormValuesReader.getDDMFormFieldValues("ddm-geolocation")

		coordinatesJSONObjects = []
	/>

	<#list ddmFormFieldValues as ddmFormFieldValue>
		<#assign
			value = ddmFormFieldValue.getValue()

			coordinatesJSONObject = jsonFactoryUtil.createJSONObject(value.getString(locale))

			coordinatesJSONObjects = coordinatesJSONObjects + [coordinatesJSONObject]
		/>
	</#list>

	<#list coordinatesJSONObjects as coordinatesJSONObject>
		<#assign featureJSONObject = jsonFactoryUtil.createJSONObject() />

		<@liferay.silently featureJSONObject.put("type", "Feature") />

		<#assign geometryJSONObject = jsonFactoryUtil.createJSONObject() />

		<@liferay.silently geometryJSONObject.put("type", "Point") />

		<#assign coordinatesJSONArray = [coordinatesJSONObject.getDouble("longitude"), coordinatesJSONObject.getDouble("latitude")] />

		<@liferay.silently geometryJSONObject.put("coordinates", coordinatesJSONArray) />

		<@liferay.silently featureJSONObject.put("geometry", geometryJSONObject) />

		<#assign propertiesJSONObject = jsonFactoryUtil.createJSONObject() />

		<@liferay.silently propertiesJSONObject.put("title", assetRenderer.getTitle(locale)) />

		<#assign entryAbstract>
			<@getAbstract asset=entry />
		</#assign>

		<@liferay.silently propertiesJSONObject.put("abstract", entryAbstract) />

		<#if stringUtil.equals(mapsAPIProvider, "Google")>
			<#assign
				images = {
					"com.liferay.document.library.kernel.model.DLFileEntry": "${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/green-dot.png",
					"com.liferay.portlet.dynamicdatalists.model.DDLRecord": "${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/red-dot.png",
					"com.liferay.journal.model.JournalArticle": "${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/blue-dot.png",
					"default": "${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/yellow-dot.png"
				}
			/>

			<#if images?keys?seq_contains(entry.getClassName())>
				<@liferay.silently propertiesJSONObject.put("icon", images[entry.getClassName()]) />
			<#else>
				<@liferay.silently propertiesJSONObject.put("icon", images["default"]) />
			</#if>
		</#if>

		<@liferay.silently featureJSONObject.put("properties", propertiesJSONObject) />

		<@liferay.silently featureJSONArray.put(featureJSONObject) />
	</#list>
</#list>

<@liferay.silently featureCollectionJSONObject.put("features", featureJSONArray) />

<style type="text/css">
	.asset-entry-abstract {
		min-width: 400px;
	}

	.leaflet-popup .asset-entry-abstract {
		display: inline-block;
	}

	.asset-entry-abstract .asset-entry-abstract-image {
		display: block;
		float: left;
		height: 128px;
		margin-right: 1em;
		text-align: center;
	}

	.asset-entry-abstract .asset-entry-abstract-image img {
		display: block;
		margin: 0 auto;
		max-height: 100%;
	}

	.asset-entry-abstract .taglib-icon {
		float: right;
	}
</style>

<@liferay_map["map-display"]
	name=''Map''
	points="${featureCollectionJSONObject}"
/>

<@liferay_aui.script use="liferay-map-base">
	Liferay.componentReady(''<@portlet.namespace />Map'').then(
		function(map) {
			map.on(
				''featureClick'',
				function(event) {
					var feature = event.feature;

					map.openDialog(
						{
							content: feature.getProperty(''abstract''),
							marker: feature.getMarker(),
							position: feature.getGeometry().get(''location'')
						}
					);
				}
			);
		}
	);
</@liferay_aui.script>

<#macro getAbstract asset>
	<div class="asset-entry-abstract" id="<@portlet.namespace />assetEntryAbstract">
		<#assign
			showEditURL = paramUtil.getBoolean(renderRequest, "showEditURL", true)

			assetRenderer = asset.getAssetRenderer()
		/>

		<#if showEditURL && assetRenderer.hasEditPermission(permissionChecker)>
			<#assign
				editPortletURL = assetRenderer.getURLEdit(renderRequest, renderResponse, windowStateFactory.getWindowState("NORMAL"), themeDisplay.getURLCurrent())
			/>

			<@liferay_ui.icon
				image="edit"
				label=true
				message="edit"
				url=editPortletURL.toString()
			/>
		</#if>

		<#if assetRenderer.getThumbnailPath(renderRequest)??>
			<div class="asset-entry-abstract-image">
				<img src="${assetRenderer.getThumbnailPath(renderRequest)}" />
			</div>
		</#if>

		<#assign assetURL = assetPublisherHelper.getAssetViewURL(renderRequest, renderResponse, assetRenderer, asset, !stringUtil.equals(assetLinkBehavior, "showFullContent")) />

		<div class="asset-entry-abstract-content">
			<h3><a href="${assetURL}">${assetRenderer.getTitle(locale)}</a></h3>

			<div>
				${assetRenderer.getSummary(renderRequest, renderResponse)}
			</div>
		</div>

		<div class="asset-entry-abstract-footer">
			<a href="${assetURL}">${languageUtil.get(locale, "read-more")} &raquo;</a>
		</div>
	</div>
</#macro>',0,37607,NULL,'2021-04-25 05:43:41'),
	 (0,0,37876,37631,37601,37607,NULL,'2021-04-25 05:43:41',20006,0,37874,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Utförlig sammanfattning</Name><Name language-id="pt_BR">Sumário Rico</Name><Name language-id="ja_JP">要約（文字数多め）</Name><Name language-id="fr_FR">Sommaire enrichi</Name><Name language-id="hu_HU">Bő összesítő</Name><Name language-id="de_DE">Rich-Text-Zusammenfassung</Name><Name language-id="ca_ES">Resum enriquit</Name><Name language-id="ar_SA">ملخص غني</Name><Name language-id="fi_FI">Muotoiltu yhteenveto</Name><Name language-id="en_US">Rich Summary</Name><Name language-id="zh_CN">丰富总结</Name><Name language-id="es_ES">Resumen completo</Name><Name language-id="nl_NL">Rijke samenvatting</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Visar sammanfattningar, ikoner, liknande tillgångar samt utskrifts- och redigeringsåtgärder för tillgångar. Valfritt inkluderar bokmärken och omdömen för tillgångar.</Description><Description language-id="pt_BR">Exibe abstracts, ícones, conteúdos relacionados e ações de imprimir/editar para os conteúdos. Opcionalmente, inclui marcadores e classificações de conteúdos.</Description><Description language-id="ja_JP">概要、アイコン、関連するアセット、アセットの印刷/編集を表示する。アセットのブックマークと評価も設定できます</Description><Description language-id="fr_FR">Affiche les résumés, icons, les assets relatifs, et les actions imprimer/éditer pour les assets. Facultativement inclut les signets et les notations d''assets.</Description><Description language-id="hu_HU">Megjeleníti a kivonatokat, ikonokat, a kapcsolódó tartalmakat, és a nyomtatási/szerkesztési műveleteket a tarlamakhoz. Opcionálisan tartalmazza a tartalom könyvjelzőket és értékeléseket.</Description><Description language-id="de_DE">Stellt Kurzfassungen, Icons, verwandte Assets sowie Druck- und Bearbeitungsoptionen für Assets dar. Kann auch Bookmarks und Bewertungen enthalten.</Description><Description language-id="ca_ES">Mostra resums, icones, continguts relacionats i accions d''impressió o edició per continguts. Opcionalment, inclou enllaços i valoracions.</Description><Description language-id="ar_SA">يعرض الملخصات والأيقونات والأصول ذات الصلة وإجراءات الطباعة/التحرير للأصول. ويمكنك بشكل اختياري تضمين الإشارات المرجعية وتقييمات الأصول.</Description><Description language-id="fi_FI">Näyttää lyhenteet, kuvakkeet, liittyvät sisällöt ja sisältöjen tulosta/muokkaa toiminnot. Voit ottaa mukaan myös sisältöjen kirjanmerkit ja arvostelut.</Description><Description language-id="en_US">Displays abstracts, icons, related assets, and print/edit actions for assets. Optionally include asset bookmarks and ratings.</Description><Description language-id="zh_CN">显示摘要、图标、相关资产以及资产的打印和编辑操作。可选择性包含资产书签和评分。</Description><Description language-id="es_ES">Muestra abstractos, iconos, activos relacionados e imprime/edita acciones para activos. Opcionalmente incluye marcadores de activos y calificaciones.</Description><Description language-id="nl_NL">Toon samenvattingen, pictogrammen, gerelateerde content en afdruk en bewerk acties voor content. Voeg optioneel bladwijzers en beoordelingen toe.</Description></root>',N'ftl',N'<#if !entries?has_content>
	<#if !themeDisplay.isSignedIn()>
		${renderRequest.setAttribute("PORTLET_CONFIGURATOR_VISIBILITY", true)}
	</#if>

	<div class="alert alert-info">
		<@liferay_ui["message"] key="there-are-no-results" />
	</div>
</#if>

<#list entries as entry>
	<#assign
		entry = entry

		assetRenderer = entry.getAssetRenderer()

		entryTitle = htmlUtil.escape(assetRenderer.getTitle(locale))

		viewURL = assetPublisherHelper.getAssetViewURL(renderRequest, renderResponse, assetRenderer, entry, !stringUtil.equals(assetLinkBehavior, "showFullContent"))
	/>

	<div class="asset-abstract">
		<div class="float-right">
			<@getPrintIcon />

			<@getFlagsIcon />

			<@getEditIcon />
		</div>

		<h3 class="asset-title">
			<a href="${viewURL}">
				${entryTitle}
			</a>
		</h3>

		<@getMetadataField fieldName="tags" />

		<@getMetadataField fieldName="create-date" />

		<@getMetadataField fieldName="view-count" />

		<div class="asset-content">
			<@getSocialBookmarks />

			<div class="asset-summary">
				<@getMetadataField fieldName="author" />

				${htmlUtil.escape(assetRenderer.getSummary(renderRequest, renderResponse))}

				<a href="${viewURL}"><@liferay.language key="read-more" /><span class="hide-accessible"><@liferay.language key="about" />${entryTitle}</span> &raquo;</a>
			</div>

			<@getRatings />

			<@getRelatedAssets />

			<@getDiscussion />
		</div>
	</div>
</#list>

<#macro getDiscussion>
	<#if getterUtil.getBoolean(enableComments) && assetRenderer.isCommentable()>
		<br />

		<@liferay_comment["discussion"]
			className=entry.getClassName()
			classPK=entry.getClassPK()
			formName="fm" + entry.getClassPK()
			ratingsEnabled=getterUtil.getBoolean(enableCommentRatings)
			redirect=currentURL
			userId=assetRenderer.getUserId()
		/>
	</#if>
</#macro>

<#macro getEditIcon>
	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>
		<#assign editPortletURL = assetRenderer.getURLEdit(renderRequest, renderResponse, windowStateFactory.getWindowState("NORMAL"), themeDisplay.getURLCurrent())!"" />

		<#if validator.isNotNull(editPortletURL)>
			<#assign title = languageUtil.format(locale, "edit-x", entryTitle, false) />

			<@liferay_ui["icon"]
				cssClass="icon-monospaced visible-interaction"
				icon="pencil"
				markupView="lexicon"
				message=title
				url=editPortletURL.toString()
			/>
		</#if>
	</#if>
</#macro>

<#macro getFlagsIcon>
	<#if getterUtil.getBoolean(enableFlags)>
		<@liferay_flags["flags"]
			className=entry.getClassName()
			classPK=entry.getClassPK()
			contentTitle=entry.getTitle(locale)
			label=false
			reportedUserId=entry.getUserId()
		/>
	</#if>
</#macro>

<#macro getMetadataField
	fieldName
>
	<#if stringUtil.split(metadataFields)?seq_contains(fieldName)>
		<span class="metadata-entry metadata-${fieldName}">
			<#assign dateFormat = "dd MMM yyyy - HH:mm:ss" />

			<#if stringUtil.equals(fieldName, "author")>
				<@liferay.language key="by" /> ${htmlUtil.escape(portalUtil.getUserName(assetRenderer.getUserId(), assetRenderer.getUserName()))}
			<#elseif stringUtil.equals(fieldName, "categories")>
				<@liferay_asset["asset-categories-summary"]
					className=entry.getClassName()
					classPK=entry.getClassPK()
					portletURL=renderResponse.createRenderURL()
				/>
			<#elseif stringUtil.equals(fieldName, "create-date")>
				${dateUtil.getDate(entry.getCreateDate(), dateFormat, locale)}
			<#elseif stringUtil.equals(fieldName, "expiration-date")>
				${dateUtil.getDate(entry.getExpirationDate(), dateFormat, locale)}
			<#elseif stringUtil.equals(fieldName, "modified-date")>
				${dateUtil.getDate(entry.getModifiedDate(), dateFormat, locale)}
			<#elseif stringUtil.equals(fieldName, "priority")>
				${entry.getPriority()}
			<#elseif stringUtil.equals(fieldName, "publish-date")>
				${dateUtil.getDate(entry.getPublishDate(), dateFormat, locale)}
			<#elseif stringUtil.equals(fieldName, "tags")>
				<@liferay_asset["asset-tags-summary"]
					className=entry.getClassName()
					classPK=entry.getClassPK()
					portletURL=renderResponse.createRenderURL()
				/>
			<#elseif stringUtil.equals(fieldName, "view-count")>
				${entry.getViewCount()} <@liferay.language key="views" />
			</#if>
		</span>
	</#if>
</#macro>

<#macro getPrintIcon>
	<#if getterUtil.getBoolean(enablePrint)>
		<#assign printURL = renderResponse.createRenderURL() />

		${printURL.setParameter("mvcPath", "/view_content.jsp")}
		${printURL.setParameter("assetEntryId", entry.getEntryId()?string)}
		${printURL.setParameter("viewMode", "print")}
		${printURL.setParameter("type", entry.getAssetRendererFactory().getType())}
		${printURL.setWindowState("pop_up")}

		<@liferay_ui["icon"]
			icon="print"
			markupView="lexicon"
			message="print"
			url="javascript:Liferay.Util.openModal({headerHTML: ''" + languageUtil.format(locale, "print-x-x", ["hide-accessible", entryTitle], false) + "'', id:''" + renderResponse.getNamespace() + "printAsset'', url: ''" + htmlUtil.escapeURL(printURL.toString()) + "''});"
		/>
	</#if>
</#macro>

<#macro getRatings>
	<#if getterUtil.getBoolean(enableRatings) && assetRenderer.isRatable()>
		<div class="asset-ratings">
			<@liferay_ui["ratings"]
				className=entry.getClassName()
				classPK=entry.getClassPK()
			/>
		</div>
	</#if>
</#macro>

<#macro getRelatedAssets>
	<#if getterUtil.getBoolean(enableRelatedAssets)>
		<@liferay_asset["asset-links"]
			assetEntryId=entry.getEntryId()
			viewInContext=!stringUtil.equals(assetLinkBehavior, "showFullContent")
		/>
	</#if>
</#macro>

<#macro getSocialBookmarks>
	<@liferay_social_bookmarks["bookmarks"]
		className=entry.getClassName()
		classPK=entry.getClassPK()
		displayStyle="${socialBookmarksDisplayStyle}"
		target="_blank"
		title=entry.getTitle(locale)
		types="${socialBookmarksTypes}"
		url=viewURL
	/>
</#macro>',0,37607,NULL,'2021-04-25 05:43:41'),
	 (0,0,37883,37631,37601,37607,NULL,'2021-04-25 05:43:41',25308,37877,37881,N'1.0',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="sv_SE">Vanligt innehåll</Name><Name language-id="pt_BR">Conteúdo Web básico</Name><Name language-id="ja_JP">基本Webコンテンツ</Name><Name language-id="fr_FR">Contenu web basique</Name><Name language-id="hu_HU">Alapvető webtartalom</Name><Name language-id="de_DE">Einfacher Webcontent</Name><Name language-id="ca_ES">Contigut web bàsic</Name><Name language-id="ar_SA">تحرير محتوى</Name><Name language-id="fi_FI">Tavallinen web-sisältö</Name><Name language-id="en_US">Basic Web Content</Name><Name language-id="zh_CN">基本 Web 内容</Name><Name language-id="es_ES">Contenido web básico</Name><Name language-id="nl_NL">Basiswebcontent</Name></root>',N'',N'ftl',N'${content.getData()}',0,37607,NULL,'2021-04-25 05:43:41'),
	 (0,0,57901,37631,37601,37607,NULL,'2021-04-25 05:43:40',27706,0,37702,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Basic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="nl_NL">Basis</Name><Name language-id="fi_FI">Perus</Name><Name language-id="fr_FR">Basique</Name><Name language-id="de_DE">Einfach</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="pt_BR">Básico</Name><Name language-id="es_ES">Básico</Name><Name language-id="sv_SE">Standard</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description></root>',N'ftl',N'<div class="row">
	<#assign
		image = ''''

		title = ''''

		description = ''''
	/>

	<#if cpCategoryContentDisplayContext.getDefaultImageSrc(themeDisplay)??>
		<#assign
			image = cpCategoryContentDisplayContext.getDefaultImageSrc(themeDisplay)
		/>
	</#if>

	<#if assetCategory??>
		<#assign
			title = assetCategory.getTitle(locale)

			description = assetCategory.getTitle(locale)
		/>
	</#if>

	<div>
		<img src="${image}">
	</div>

	<div class="container-fluid-1280">
		<h1>${title}</h1>

		<p>${description}</p>
	</div>
</div>',0,37607,NULL,'2021-04-25 05:43:40');
INSERT INTO DDMTemplateVersion (mvccVersion,ctCollectionId,templateVersionId,groupId,companyId,userId,userName,createDate,classNameId,classPK,templateId,version,name,description,[language],script,status,statusByUserId,statusByUserName,statusDate) VALUES
	 (0,0,57902,37631,37601,37607,NULL,'2021-04-25 05:43:40',27708,0,37708,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Arrows</Name><Name language-id="ar_SA">الأسهم</Name><Name language-id="ca_ES">Fletxes</Name><Name language-id="zh_CN">箭头</Name><Name language-id="nl_NL">Pijlen</Name><Name language-id="fi_FI">Nuolet</Name><Name language-id="fr_FR">Flèches</Name><Name language-id="de_DE">Pfeile</Name><Name language-id="hu_HU">Nyilak</Name><Name language-id="ja_JP">矢印</Name><Name language-id="pt_BR">Setas</Name><Name language-id="es_ES">Flechas</Name><Name language-id="sv_SE">Pilar</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description><Description language-id="ar_SA">يعرض مسار تنقل تفصيلي يتم فيه تمثيل كل عنصر تنقل بواسطة سهم به عنوانه ورابطه.</Description><Description language-id="ca_ES">Mostra una ruta de navegació en què cada element de navegació es representa amb una fletxa amb el seu títol i enllaç.</Description><Description language-id="zh_CN">显示一个面包屑导航，其中每一个导航元素都由箭头及其标题和链接表示。</Description><Description language-id="nl_NL">Geeft een broodkruimel weer waarin elk navigatie-element voorgesteld wordt door een pijl met een titel en link.</Description><Description language-id="fi_FI">Näyttää murupolun, jossa jokainen navigointielementti näkyy nuolena otsikkoineen ja linkkinä.</Description><Description language-id="fr_FR">Affiche un fil d''Ariane dans lequel chaque élément de navigation est représenté par une flèche avec son propre titre et son propre lien.</Description><Description language-id="de_DE">Zeigt eine Breadcrumbnavigation an, bei der jedes Navigationselement durch einen Pfeil mit seinem Titel und einem Link dargestellt wird.</Description><Description language-id="hu_HU">Megjelenít egy úrkövetőt, amelyen minden navigációs elemet egy nyíl képvisel címmel és hivatkozással tartalmaz.</Description><Description language-id="ja_JP">すべてのナビゲーション要素が矢印とタイトル、リンクで表示されるように、パンくずリストを表示します。</Description><Description language-id="pt_BR">Exibe um caminho de navegação onde cada elemento de navegação é representado por uma seta com seu título e link.</Description><Description language-id="es_ES">Muestra una ruta de navegación donde cada elemento de navegación se representa mediante una flecha con su título y enlace.</Description><Description language-id="sv_SE">Visar en länkstig där varje navigeringselement representeras av en pil med titel och länk.</Description></root>',N'ftl',N'<#if entries?has_content>
	<@liferay_util["html-top"]>
		<style>
			.breadcrumb-arrows li {
				background-color: #EFEFEF;
				margin-bottom: 3px;
				overflow: visible;
			}

			.breadcrumb-arrows li + li::before {
				content: none;
			}

			.breadcrumb-arrows li > a {
				border-right: 4px solid #FFF;
				display: block;
				max-width: 100%;
				position: relative;
			}

			.breadcrumb-arrows .entry {
				line-height: 40px;
				overflow: hidden;
				padding-left: 30px;
				padding-right: 7px;
				text-overflow: ellipsis;
				white-space: nowrap;
			}

			.breadcrumb-arrows a::after {
				border-bottom: 20px inset transparent;
				border-left: 20px solid #EFEFEF;
				border-top: 20px inset transparent;
				content: '''';
				height: 0;
				position: absolute;
				right: -20px;
				top: 0;
				width: 0;
				z-index: 2;
			}

			.breadcrumb-arrows li:nth-child(n+2) a::before {
				border-bottom: 20px inset transparent;
				border-left: 20px solid #FFF;
				border-top: 20px inset transparent;
				content: '''';
				height: 0;
				left: 0;
				position: absolute;
				top: 0;
				width: 0;
			}

			.breadcrumb-arrows li:last-child {
				border-bottom-right-radius: 4px;
				border-right-width: 0;
				border-top-right-radius: 4px;
				position: relative;
			}

			.breadcrumb-arrows li:last-child::before {
				border-bottom: 20px inset transparent;
				border-left: 20px solid #FFF;
				border-top: 20px inset transparent;
				content: '''';
				height: 0;
				left: 0;
				position: absolute;
				top: 0;
				width: 0;
			}

			.breadcrumb-arrows li:last-child .entry {
				padding-right: 23px;
			}

			.breadcrumb-arrows li:first-child {
				border-bottom-left-radius: 4px;
				border-top-left-radius: 4px;
			}

			.breadcrumb-arrows li:first-child::before {
				border-left-width: 0;
			}

			.breadcrumb-arrows li:first-child .entry {
				padding-left: 23px;
			}

			.breadcrumb-arrows .active {
				background-color: #007ACC;
			}

			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {
				color: #FFF;
			}

			.breadcrumb-arrows .active a::after {
				border-left-color: #007ACC;
			}

			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {
				border-right-color: #F5F7F8;
			}

			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {
				border-left-color: #F5F7F8;
			}
		</style>
	</@>

	<div class="breadcrumb breadcrumb-arrows">
		<#assign cssClass = "" />

		<#list entries as entry>
			<#if entry?is_last>
				<#assign cssClass = "active" />
			</#if>

			<li class="${cssClass}" <#if entry?is_last>aria-current="page"</#if>>
				<#if entry?has_next>
					<a

					<#if entry.isBrowsable()>
						href="${entry.getURL()!""}"
					</#if>

					>
				</#if>

				<div class="entry">
					${htmlUtil.escape(entry.getTitle())}
				</div>

				<#if entry?has_next>
					</a>
				</#if>
			</li>
		</#list>
	</div>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
