	 (0,0,57904,37631,37601,37607,NULL,'2021-04-25 05:43:40',27708,0,37714,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Vertical</Name><Name language-id="ar_SA">رأسي</Name><Name language-id="ca_ES">Vertical</Name><Name language-id="zh_CN">垂直</Name><Name language-id="nl_NL">Verticaal</Name><Name language-id="fi_FI">Pystysuora</Name><Name language-id="fr_FR">Vertical</Name><Name language-id="de_DE">Vertikal</Name><Name language-id="hu_HU">Függőleges</Name><Name language-id="ja_JP">垂直方向</Name><Name language-id="pt_BR">Vertical</Name><Name language-id="es_ES">Vertical</Name><Name language-id="sv_SE">Vertikal</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays a breadcrumb vertically.</Description><Description language-id="ar_SA">يعرض مسار تنقل رأسيًا.</Description><Description language-id="ca_ES">Mostra una ruta de navegació verticalment.</Description><Description language-id="zh_CN">垂直显示面包屑导航。</Description><Description language-id="nl_NL">Geeft een broodkruimel verticaal weer.</Description><Description language-id="fi_FI">Näyttää murupolun pystysuoraan.</Description><Description language-id="fr_FR">Affiche un fil d''Ariane vertical.</Description><Description language-id="de_DE">Zeigt eine Breadcrumbnavigation vertikal an.</Description><Description language-id="hu_HU">Megjelenít egy útkövetőjelet függőlegesen.</Description><Description language-id="ja_JP">パンくずリストをを垂直方向に表示します</Description><Description language-id="pt_BR">Exibe um caminho de navegação verticalmente.</Description><Description language-id="es_ES">Muestra una ruta de navegación verticalmente.</Description><Description language-id="sv_SE">Visar en länkstig vertikalt.</Description></root>',N'ftl',N'<#if entries?has_content>
