lichen Größen auf Basis der Häufigkeit anzeigen.</Description><Description language-id="hu_HU">Jelenítse meg a kifejezéseket hivatkozások sorközi listájaként a gyakoriságtól függően változó méretben.</Description><Description language-id="ja_JP">用語を頻度に応じてサイズが変わるインライン形式のリンクリストとして表示します。</Description><Description language-id="pt_BR">Exibir termos como uma lista embutida de links com tamanhos variados baseados pela frequência.</Description><Description language-id="es_ES">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id="sv_SE">Visa villkoren som en infogad lista med länkar med olika storlekar baserat på frekvens.</Description></root>',N'ftl',N'<@liferay_ui["panel-container"]
