	 (0,0,57917,37631,37601,37607,NULL,'2021-04-25 05:43:40',27723,0,37819,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">List Layout</Name><Name language-id="ar_SA">مخطط قائمة</Name><Name language-id="ca_ES">Disposició de la llista</Name><Name language-id="zh_CN">列表布局</Name><Name language-id="nl_NL">Lijstlay-out</Name><Name language-id="fi_FI">Luetteloasettelu</Name><Name language-id="fr_FR">Disposition en liste</Name><Name language-id="de_DE">Listenlayout</Name><Name language-id="hu_HU">Lista elrendezés</Name><Name language-id="ja_JP">リストレイアウト</Name><Name language-id="pt_BR">Layout da Lista</Name><Name language-id="es_ES">Diseño de lista</Name><Name language-id="sv_SE">Listlayout</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display results with their title, creator''s user name, asset type, and creation date.</Description><Description language-id="ar_SA">عرض النتائج من خلال عناوينها، واسم المستخدم المنشئ ونوع الأصل وتاريخ الإنشاء.</Description><Description language-id="ca_ES">Mostra els resultats amb el títol, el nom d''usuari del creador, el tipus de contingut i la data de creació.</Description><Description language-id="zh_CN">显示结果及其标题、创建者用户名、资源类型和创建日期。</Description><Description language-id="nl_NL">Resultaten weergeven met hun titel, de gebruikersnaam van de maker, het assettype en de aanmaakdatum.</Description><Description language-id="fi_FI">Näytä tulokset otsikoineen, luojan käyttäjänimineen, sisältötyyppeineen ja luontipäivineen.</Description><Description language-id="fr_FR">Afficher les résultats avec leur intitulé, le nom d''utilisateur du créateur, le type d''actif et la date de création.</Description><Description language-id="de_DE">Ergebnisse mit deren Titel, Benutzername des Erstellers, Assettyp und Erstellungsdatum anzeigen.</Description><Description language-id="hu_HU">A találatokat jelenítse meg címmel, a készítő felhasználónevével, tartalomtípussal és leírással.</Description><Description language-id="ja_JP">結果とそのタイトル、作成者のユーザー名、アセットタイプ、作成日を表示します。</Description><Description language-id="pt_BR">Exibir resultados com seus títulos, nome de usuário do criador, tipo de conteúdo e data de criação.</Description><Description language-id="es_ES">Muestra resultados con el título, el nombre de usuario del autor, el tipo de activo y la fecha de creación.</Description><Description language-id="sv_SE">Visa resultat med titel, skaparens användarnamn, tillgångstyp och skapandedatum.</Description></root>',N'ftl',N'<div class="search-total-label">
	${languageUtil.format(locale, "x-results-for-x", [searchContainer.getTotal(), "<strong>" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + "</strong>"], false)}
</div>

<div class="display-list">
	<ul class="list-group" id="search-results-display-list">
		<#if entries?has_content>
			<#list entries as entry>
				<li class="list-group-item list-group-item-flex">
					<#if !entry.isTemporarilyUnavailable()>
						<div class="autofit-col">
							<#if entry.isUserPortraitVisible()>
								<@liferay_ui["user-portrait"] userId=entry.getAssetEntryUserId() />
							</#if>

							<#if entry.isThumbnailVisible()>
								<img alt="${languageUtil.get(locale, "thumbnail")}" class="img-rounded search-result-thumbnail-img" src="${entry.getThumbnailURLString()}" />
							</#if>

							<#if entry.isIconVisible()>
								<span class="search-asset-type-sticker sticker sticker-rounded sticker-secondary sticker-static">
									<@clay.icon symbol="${entry.getIconId()}" />
								</span>
							</#if>
						</div>

						<div class="autofit-col autofit-col-expand">
							<section class="autofit-section">
								<div class="list-group-title">
									<a href="${entry.getViewURL()}">
										${entry.getHighlightedTitle()}
									</a>
								</div>

								<div class="search-results-metadata">
									<p class="list-group-subtext">
										<#if entry.isModelResourceVisible()>
											<span class="subtext-item">
												<strong>${entry.getModelResource()}</strong>
											</span>
										</#if>

										<#if entry.isLocaleReminderVisible()>
											<@liferay_ui["icon"]
												icon="../language/${entry.getLocaleLanguageId()}"
												message=entry.getLocaleReminder()
											/>
										</#if>

										<#if entry.isCreatorVisible()>
											<span class="subtext-item">
												&#183;

												<@liferay.language key="written-by" />

												<strong>${htmlUtil.escape(entry.getCreatorUserName())}</strong>
											</span>
										</#if>

										<#if entry.isCreationDateVisible()>
											<span class="subtext-item">
												<@liferay.language key="on-date" />

												${entry.getCreationDateString()}
											</span>
										</#if>
									</p>

									<#if entry.isContentVisible()>
										<p class="list-group-subtext">
											<span class="subtext-item">
												${entry.getContent()}
											</span>
										</p>
									</#if>

									<#if entry.isFieldsVisible()>
										<p class="list-group-subtext">
											<#assign separate = false />

											<#list entry.getFieldDisplayContexts() as fieldDisplayContext>
												<#if separate>
													&#183;
												</#if>

												<span class="badge">${fieldDisplayContext.getName()}</span>

												<span>${fieldDisplayContext.getValuesToString()}</span>

												<#assign separate = true />
											</#list>
										</p>
									</#if>

									<#if entry.isAssetCategoriesOrTagsVisible()>
										<h6 class="search-document-tags text-default">
											<@liferay_asset["asset-tags-summary"]
												className=entry.getClassName()
												classPK=entry.getClassPK()
												paramName=entry.getFieldAssetTagNames()
												portletURL=entry.getPortletURL()
											/>

											<@liferay_asset["asset-categories-summary"]
												className=entry.getClassName()
												classPK=entry.getClassPK()
												paramName=entry.getFieldAssetCategoryIds()
												portletURL=entry.getPortletURL()
											/>
										</h6>
									</#if>

									<#if entry.isDocumentFormVisible()>
										<h6 class="expand-details text-default">
											<span class="list-group-text" style="">
												<a href="javascript:;">
													<@liferay.language key="details" />...
												</a>
											</span>
										</h6>

										<div class="hide search-results-list table-details table-responsive">
											<table class="table">
												<thead>
													<tr>
														<th class="key-column">
															<@liferay.language key="key" />
														</th>
														<th>
															<@liferay.language key="value" />
														</th>
													</tr>
												</thead>

												<tbody>
													<#list entry.getDocumentFormFieldDisplayContexts() as fieldDisplayContext>
														<tr>
															<td class="key-column table-details-content">
																<strong>${htmlUtil.escape(fieldDisplayContext.getName())}</strong>
															</td>
															<td class="table-details-content">
																<code>
																	${fieldDisplayContext.getValuesToString()}
																</code>
															</td>
														</tr>
													</#list>
												</tbody>
											</table>
										</div>
									</#if>
								</div>
							</section>
						</div>
					<#else>
						<div class="autofit-col">
							<div class="alert alert-danger">
								<@liferay.language_format
									arguments="result"
									key="is-temporarily-unavailable"
								/>
							</div>
						</div>
					</#if>
				</li>
			</#list>
		</#if>
	</ul>
</div>

<@liferay_aui.script use="aui-base">
	A.one(''#search-results-display-list'').delegate(
		''click'',
		function(event) {
			var currentTarget = event.currentTarget;

			currentTarget.siblings(''.search-results-list'').toggleClass(''hide'');
		},
		''.expand-details''
	);
</@liferay_aui.script>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57918,37631,37601,37607,NULL,'2021-04-25 05:43:40',27723,0,37822,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Card Layout</Name><Name language-id="ar_SA">مخطط البطاقة</Name><Name language-id="ca_ES">Disposició de la targeta</Name><Name language-id="zh_CN">卡片布局</Name><Name language-id="nl_NL">Kaartlay-out</Name><Name language-id="fi_FI">Kortin Asettelu</Name><Name language-id="fr_FR">Disposition de la carte</Name><Name language-id="de_DE">Kartenlayout</Name><Name language-id="hu_HU">Kártyaelrendezés</Name><Name language-id="ja_JP">カードレイアウト</Name><Name language-id="pt_BR">Layout do Cartão</Name><Name language-id="es_ES">Diseño de tarjeta</Name><Name language-id="sv_SE">Kortlayout</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Display results with a grid of cards.</Description><Description language-id="ar_SA">عرض النتائج من خلال شبكة من البطاقات.</Description><Description language-id="ca_ES">Mostra els resultats com una sèrie de cartes.</Description><Description language-id="zh_CN">显示结果与卡片网格。</Description><Description language-id="nl_NL">Resultaten weergeven als een kaartenrooster.</Description><Description language-id="fi_FI">Näytä tulokset korttien ruudukkona.</Description><Description language-id="fr_FR">Afficher les résultats sous la forme de grille de cartes.</Description><Description language-id="de_DE">Ergebnisse als Kartengitter anzeigen.</Description><Description language-id="hu_HU">Az eredményeket jelenítse meg kártyarácsként.</Description><Description language-id="ja_JP">結果をグリッド状に配置したカードで表示します。</Description><Description language-id="pt_BR">Exibir resultados com uma série de cartões.</Description><Description language-id="es_ES">Muestra resultados con una cuadrícula de tarjetas.</Description><Description language-id="sv_SE">Visa resultat som ett rutnät med kort.</Description></root>',N'ftl',N'<div class="search-total-label">
	${languageUtil.format(locale, "x-results-for-x", [searchContainer.getTotal(), "<strong>" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + "</strong>"], false)}
</div>

<div class="display-card">
	<ul class="card-page">
		<#if entries?has_content>
			<#list entries as entry>
				<li class="card-page-item card-page-item-asset">
					<div class="card card-type-asset file-card">
						<div class="aspect-ratio card-item-first">
							<#if entry.isThumbnailVisible()>
								<img alt="${entry.getTitle()}" class="aspect-ratio-item aspect-ratio-item-center-middle aspect-ratio-item-vertical-fluid" src="${entry.getThumbnailURLString()}" />
							<#else>
								<div class="aspect-ratio-item aspect-ratio-item-center-middle aspect-ratio-item-vertical-fluid card-type-asset-icon">
									<@clay.icon symbol="${(entry.isIconVisible())?then(entry.getIconId(),''web-content'')}" />
								</div>
							</#if>
						</div>

						<div class="card-body">
							<div class="card-row">
								<div class="autofit-col autofit-col-expand">
									<section class="autofit-section">
										<h3 class="card-title">
											<a href="${entry.getViewURL()}">
												${entry.getHighlightedTitle()}
											</a>
										</h3>

										<#if entry.isCreatorVisible()>
											<p class="card-subtitle">
												<span class="text-truncate-inline">
													<span class="text-truncate">
														${htmlUtil.escape(entry.getCreatorUserName())}
													</span>
												</span>
											</p>
										</#if>

										<#if entry.isCreationDateVisible()>
											<p class="card-subtitle">
												<span class="text-truncate-inline">
													<span class="text-truncate">
														${entry.getCreationDateString()}
													</span>
												</span>
											</p>
										</#if>

										<#if entry.isModelResourceVisible()>
											<p class="card-subtitle">
												<span class="text-truncate-inline">
													<span class="text-truncate">
														${entry.getModelResource()}
													</span>
												</span>
											</p>
										</#if>

										<#if entry.isContentVisible()>
											<p class="card-description">
												${entry.getContent()}
											</p>
										</#if>
									</section>
								</div>
							</div>
						</div>
					</div>
				</li>
			</#list>
		</#if>
	</ul>
</div>',0,37607,NULL,'2021-04-25 05:43:40'),
