さくまとめられます</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description></root>',N'ftl',N'<#assign count = 0 />

<#if entries?has_content>
	<div class="row">
		<#assign
			orderPrice = commerceCartContentMiniDisplayContext.getCommerceOrderPrice()

			subTotal = orderPrice.getSubtotal()
		/>

		<div class="col-md-12">
			<strong>Total: ${subTotal.format(themeDisplay.getLocale())}</strong>
		</div>

		<#list entries as curCommerceOrderItem>
			<#assign
				cpDefinition = curCommerceOrderItem.getCPDefinition()

				image = ''''

				productURL = commerceCartContentMiniDisplayContext.getCPDefinitionURL(cpDefinition.getCPDefinitionId(), themeDisplay)

				name = cpDefinition.getName(themeDisplay.getLanguageId())
			/>

			<#if commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)??>
				<#assign
					image = commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)
				/>
			</#if>

			<div class="col-md-6">
				<div class="row-fluid">
					<img class="w-100" src="${image}">
				</div>

				<div class="row-fluid">
					<a href="${productURL}">
						<strong>${name}</strong>
					</a>

					<div class="commerce-price-section d-inline float-right">
						<@liferay_commerce["price"]
							CPDefinitionId=cpDefinition.getCPDefinitionId()
							CPInstanceId=curCommerceOrderItem.getCPInstanceId()
							showDiscount=false
						/>
					</div>
				</div>
			</div>

			<#assign count = count + 1 />

			<#if count gte 2>
				</div>

				<div class="row">

				<#assign count = 0 />
			</#if>
		</#list>
	</div>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57930,37631,37601,37607,NULL,'2021-04-25 05:43:40',27712,0,37723,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Basic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="nl_NL">Basis</Name><Name language-id="fi_FI">Perus</Name><Name language-id="fr_FR">Basique</Name><Name language-id="de_DE">Einfach</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="pt_BR">Básico</Name><Name language-id="es_ES">Básico</Name><Name language-id="sv_SE">Standard</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小