	 (0,0,57941,37631,37601,37607,NULL,'2021-04-25 05:43:40',20098,0,37756,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Navigation common macros</Name><Name language-id="ar_SA">وحدات الماكرو الشائعة للتنقل</Name><Name language-id="ca_ES">Macros comunes de navegació</Name><Name language-id="zh_CN">导航常用宏</Name><Name language-id="nl_NL">Algemene navigatiemacro''s</Name><Name language-id="fi_FI">Navigoinnin yleiset makrot</Name><Name language-id="fr_FR">Macros de navigation ordinaires</Name><Name language-id="de_DE">Navigation häufige Makros</Name><Name language-id="hu_HU">Navigáció közös makrói</Name><Name language-id="ja_JP">ナビゲーションの一般的なマクロ</Name><Name language-id="pt_BR">Macros de navegação comuns</Name><Name language-id="es_ES">Macros comunes de navegación</Name><Name language-id="sv_SE">Navigering i vanliga makron</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Contains common macros for navigation menu templates.</Description><Description language-id="ar_SA">يحتوي على وحدات ماكرو شائعة لقوالب قائمة التنقل.</Description><Description language-id="ca_ES">Conté macros comunes per a les plantilles del menú de navegació.</Description><Description language-id="zh_CN">包含导航菜单模板的常用宏。</Description><Description language-id="nl_NL">Bevat algemene macro''s voor navigatiemenusjablonen.</Description><Description language-id="fi_FI">Sisältää yleiset navigointivalikkomallien makrot.</Description><Description language-id="fr_FR">Contient les macros ordinaires pour les modèles de menu de navigation.</Description><Description language-id="de_DE">Enthält häufige Makros für Navigationsmenüvorlagen.</Description><Description language-id="hu_HU">A navigációs menü sablonok közös makróit tartalmazza.</Description><Description language-id="ja_JP">ナビゲーションメニューテンプレート用のマクロを含みます</Description><Description language-id="pt_BR">Contém macros comuns para o modelo do menu de navegação.</Description><Description language-id="es_ES">Contiene macros comunes para plantillas del menú de navegación.</Description><Description language-id="sv_SE">Innehåller vanliga makron för navigeringsmenymallar.</Description></root>',N'ftl',N'<#macro buildChildrenNavItems
	displayDepth
	navItem
	navItemLevel = 2
>
	<#assign
		portletDisplay = themeDisplay.getPortletDisplay()
	/>

	<#list navItem.getChildren() as childNavigationItem>
		<#assign
			nav_child_css_class = ""
		/>

		<#if childNavigationItem.isChildSelected() || childNavigationItem.isSelected()>
			<#assign
				nav_child_css_class = "active selected"
			/>
		</#if>

		<li class="${nav_child_css_class}" id="layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}" role="presentation">
			<#if childNavigationItem.isBrowsable()>
				<a aria-labelledby="layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}" class="dropdown-item" href="${childNavigationItem.getURL()}" ${childNavigationItem.getTarget()} role="menuitem">${childNavigationItem.getName()}</a>
			<#else>
				<span class="dropdown-item font-weight-semi-bold navigation-menu__submenu">${childNavigationItem.getName()}</span>
			</#if>
		</li>

		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>
			<ul class="list-unstyled pl-3">
				<@buildChildrenNavItems
					displayDepth=displayDepth
					navItem=childNavigationItem
					navItemLevel=(navItemLevel + 1)
				/>
			</ul>
		</#if>
	</#list>
</#macro>

<#macro buildNavigation
	branchNavItems
	cssClass
	displayDepth
	includeAllChildNavItems
	navItemLevel
	navItems
>
	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>
		<ul class="${cssClass} level-${navItemLevel}">
			<#list navItems as navItem>
				<#assign
					nav_item_css_class = "lfr-nav-item"
				/>

				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>
					<#assign nav_item_css_class = "${nav_item_css_class} open" />
				</#if>

				<#if navItem.isChildSelected() || navItem.isSelected()>
					<#assign
						nav_item_css_class = "${nav_item_css_class} selected active"
					/>
				</#if>

				<li class="${nav_item_css_class}">
					<#if navItem.isBrowsable()>
						<a class="${nav_item_css_class}" href="${navItem.getRegularURL()!""}" ${navItem.getTarget()}>${navItem.getName()}</a>
					<#else>
						${navItem.getName()}
					</#if>

					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>
						<@buildNavigation
							branchNavItems=branchNavItems
							cssClass=cssClass
							displayDepth=displayDepth
							includeAllChildNavItems=includeAllChildNavItems
							navItemLevel=(navItemLevel + 1)
							navItems=navItem.getChildren()
						/>
					</#if>
				</li>
			</#list>
		</ul>
	</#if>
</#macro>',0,37607,NULL,'2021-04-25 05:43:40');
INSERT INTO DDMTemplateVersion (mvccVersion,ctCollectionId,templateVersionId,groupId,companyId,userId,userName,createDate,classNameId,classPK,templateId,version,name,description,[language],script,status,statusByUserId,statusByUserName,statusDate) VALUES
	 (0,0,57942,37631,37601,37607,NULL,'2021-04-25 05:43:40',20098,0,37759,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Split Button Dropdowns</Name><Name language-id="ar_SA">تقسيم القوائم المنسدلة للأزرار</Name><Name language-id="ca_ES">Desplegables de botó de divisió</Name><Name language-id="zh_CN">拆分按钮下拉菜单</Name><Name language-id="nl_NL">Rolmenu met uitgesplitste knoppen</Name><Name language-id="fi_FI">Jakopainikkeen Pudotusvalikot</Name><Name language-id="fr_FR">Partager les boutons du menu déroulant</Name><Name language-id="de_DE">Dropdown mit geteilten Schaltflächen</Name><Name language-id="hu_HU">Osztott gomb legördülő elemei</Name><Name language-id="ja_JP">スプリットボタンのドロップダウン</Name><Name language-id="pt_BR">Dividir menus suspensos de botão</Name><Name language-id="es_ES">Desplegables de botón de expansión</Name><Name language-id="sv_SE">Nedrullningsbara listor med delningsknappar</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id="ar_SA">يعرض قائمة تنقل منسدلة تحتوي على عناصر قائمة جذر تظهر كأزرار.</Description><Description language-id="ca_ES">Mostra un menú de navegació desplegable els elements de menú arrel que es mostren com a botons.</Description><Description language-id="zh_CN">显示下拉式导航菜单，其中根菜单项显示为按钮。</Description><Description language-id="nl_NL">Geeft een rolmenu voor navigatie weer met rootmenu-items in de vorm van knoppen.</Description><Description language-id="fi_FI">Näyttää pudotusnavigointivalikon juurivalikon kohdat esitettynä painikkeina.</Description><Description language-id="fr_FR">Affiche un menu de navigation déroulant dont les éléments sont affichés sous la forme de boutons.</Description><Description language-id="de_DE">Zeigt ein Dropdown-Navigationsmenü mit Root-Menüelementen als Schaltflächen an.</Description><Description language-id="hu_HU">Megjelenít egy lenyíló navigációs menüt, amelyben a gyökérszintű menüpontok gombokként jelennek meg.</Description><Description language-id="ja_JP">ボタン形式のドロップダウンでナビゲーション メニューを表示します。</Description><Description language-id="pt_BR">Exibe um menu de navegação suspenso com itens do menu raiz mostrados como botões.</Description><Description language-id="es_ES">Muestra un menú de navegación desplegable con elementos de menú raíz que se muestran como botones.</Description><Description language-id="sv_SE">Visar en nedrullningsbar navigeringsmeny med rotmenyobjekt som visas som knappar.</Description></root>',N'ftl',N'<#include "${templatesPath}/NAVIGATION-MACRO-FTL" />

<#if !entries?has_content>
	<#if themeDisplay.isSignedIn()>
		<div class="alert alert-info">
			<@liferay.language key="there-are-no-menu-items-to-display" />
		</div>
	</#if>
<#else>
	<#assign
		portletDisplay = themeDisplay.getPortletDisplay()

		navbarId = "navbar_" + portletDisplay.getId()
	/>

	<div id="${navbarId}">
		<ul class="navbar-site split-button-dropdowns">
			<#assign navItems = entries />

			<#list navItems as navItem>
				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />

				<#if navItem.isBrowsable() || showChildrenNavItems>
					<#assign
						nav_item_css_class = ""
						nav_item_href_link = ""
					/>

					<#if navItem.isChildSelected() || navItem.isSelected()>
						<#assign nav_item_css_class = "active" />
					</#if>

					<#if navItem.isBrowsable()>
						<#assign nav_item_href_link = "href=''${navItem.getURL()}'' ${navItem.getTarget()}" />
					</#if>

					<li>
						<#if showChildrenNavItems>
							<#assign toggle_text>
								<@liferay.language key="toggle" />
							</#assign>

							<div class="btn-group">
						</#if>

						<a aria-labelledby="layout_${portletDisplay.getId()}_${navItem.getLayoutId()}" class="${nav_item_css_class} btn btn-secondary" ${nav_item_href_link}><span>${navItem.getName()}</span></a>

						<#if showChildrenNavItems>
							<button aria-expanded="false" aria-haspopup="true" class="${nav_item_css_class} btn btn-secondary c-px-2 dropdown-toggle" data-toggle="liferay-dropdown" type="button">
								<@liferay_aui.icon
									image="angle-down"
									markupView="lexicon"
								/>

								<span class=''sr-only''>${toggle_text}</span>
							</button>

							<ul aria-expanded="false" class="child-menu dropdown-menu" role="menu">
								<@buildChildrenNavItems
									displayDepth=displayDepth
									navItem=navItem
								/>
							</ul>

							</div>
						</#if>
					</li>
				</#if>
			</#list>
		</ul>
	</div>

	<@liferay_aui.script use="liferay-navigation-interaction">
		var navigation = A.one(''#${navbarId}'');

		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = ''.navbar-site'';
		Liferay.Data.NAV_LIST_SELECTOR = ''.navbar-site'';

		if (navigation) {
			navigation.plug(Liferay.NavigationInteraction);
		}
	</@>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57943,37631,37601,37607,NULL,'2021-04-25 05:43:40',20004,0,37855,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Multi Column Layout</Name><Name language-id="ar_SA">تخطيط أعمدة متعددة</Name><Name language-id="ca_ES">Plana multi-columna</Name><Name language-id="zh_CN">多列布局</Name><Name language-id="nl_NL">Lay-out met meerdere kolommen</Name><Name language-id="fi_FI">Usean sarakkeen asettelu</Name><Name language-id="fr_FR">Mise en page multi-colonne</Name><Name language-id="de_DE">Multi-Spalten-Layout</Name><Name language-id="hu_HU">Több oszlopos elrendezés</Name><Name language-id="ja_JP">複数カラムレイアウト</Name><Name language-id="pt_BR">Layout em Múltiplas Colunas</Name><Name language-id="es_ES">Diseño con varias columnas</Name><Name language-id="sv_SE">Layout med flera kolumner</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary''s top level categories listed underneath.</Description><Description language-id="ar_SA">يعرض عمودًا لكل مفرد. يتضمن كل عمود اسم المفرد مع فئات المستوى الأعلى للمفردات المدرجة تحتها.</Description><Description language-id="ca_ES">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell més alta a sota.</Description><Description language-id="zh_CN">显示一列中的每个词汇，每列包括顶级类别之下的词汇名字。</Description><Description language-id="nl_NL">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorieën eronder.</Description><Description language-id="fi_FI">Näyttää sarakkeen jokaiselle sanastolle. Jokainen sarake sisältää sanaston nimen, missä sanaston ylätason luokitukset on listattu.</Description><Description language-id="fr_FR">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d''un vocabulaire avec les catégories du niveau racine listées en dessous.</Description><Description language-id="de_DE">Stellt eine Spalte für jedes Vokabular dar. Jede Spalte enthält den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id="hu_HU">Megjelenít egy oszlopot minden szótár számára. Minden oszlop tartalmazza a szótár nevét, alatta a szótár felső szintű kategóriáival.</Description><Description language-id="ja_JP">各ボキャブラリ用に列を表示する。各列は以下にリストになっている、最上位に設定されている用語名を含んでいます</Description><Description language-id="pt_BR">Exibe uma coluna para cada vocabulário. Cada coluna inclui o nome do vocabulário com as categorias de nível mais alto listadas abaixo dele.</Description><Description language-id="es_ES">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categorías de mayor nivel del vocabulario listadas debajo.</Description><Description language-id="sv_SE">Visar en kolumn för varje ordlista. Varje kolumn inkluderar namnet på en ordlista med ordlistans toppnivåkategorier listade under.</Description></root>',N'ftl',N'<#assign hasCategories = false />

<#if entries?has_content>
	<@liferay_aui.row>
		<#list entries as entry>
			<#assign categories = entry.getCategories() />

			<#if categories?has_content>
				<#assign hasCategories = true />

				<@liferay_aui.col width=25>
					<div class="results-header">
						<h3>
							${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}
						</h3>
					</div>

					<@displayCategories categories=categories />
				</@liferay_aui.col>
			</#if>
		</#list>

		<#if !hasCategories>
			${renderRequest.setAttribute("PORTLET_CONFIGURATOR_VISIBILITY", true)}

			<div class="alert alert-info w-100">
				<@liferay_ui.message key="there-are-no-categories" />
			</div>
		</#if>
	</@liferay_aui.row>
</#if>

<#macro displayCategories
	categories
>
	<#if categories?has_content>
		<ul class="categories">
			<#list categories as category>
				<li>
					<#assign categoryURL = renderResponse.createRenderURL() />

					${categoryURL.setParameter("resetCur", "true")}
					${categoryURL.setParameter("categoryId", category.getCategoryId()?string)}

					<a href="${categoryURL}">${category.getName()}</a>

					<#if serviceLocator??>
						<#assign
							assetCategoryService = serviceLocator.findService("com.liferay.asset.kernel.service.AssetCategoryService")

							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())
						/>

						<@displayCategories categories=childCategories />
					</#if>
				</li>
			</#list>
		</ul>
	</#if>
</#macro>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57944,37631,37601,37607,NULL,'2021-04-25 05:43:40',20008,0,37783,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Color by Popularity</Name><Name language-id="ar_SA">الألوان حسب الأولوية</Name><Name language-id="ca_ES">Color per popularitat</Name><Name language-id="zh_CN">受欢迎的颜色</Name><Name language-id="nl_NL">Kleur op populariteit</Name><Name language-id="fi_FI">Väri suosion mukaan</Name><Name language-id="fr_FR">Couleur par popularité</Name><Name language-id="de_DE">Nach Popularität färben</Name><Name language-id="hu_HU">Szín népszerűség alapján</Name><Name language-id="ja_JP">頻出度により色分けする</Name><Name language-id="pt_BR">Colorir por Popularidade</Name><Name language-id="es_ES">Color por popularidad</Name><Name language-id="sv_SE">Färga efter popularitet</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description><Description language-id="ar_SA">يعرض علامات الأصول الملونة حسب الأولوية: الأحمر (مرتفع) والأصفر (متوسط) والأخضر (منخفض).</Description><Description language-id="ca_ES">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id="zh_CN">显示资源标签颜色等级： 红色 (高), 黄色 (中), 绿色 (低).</Description><Description language-id="nl_NL">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description><Description language-id="fi_FI">Näyttää sisältötageja, mitkä on väritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virheä (alhainen)</Description><Description language-id="fr_FR">Affiche les étiquettes d''asset coloriées par popularité: rouge (élevé), jaune (moyen), et vert (bas).</Description><Description language-id="de_DE">Schlagwörter nach Popularität färben: Rot (hoch), gelb (mittel), grün (niedrig).</Description><Description language-id="hu_HU">Megjeleníti a tartalom címkéket népszerűség szerint színezve: vörös (magas), sárga (közepes), és zöld (alacsony).</Description><Description language-id="ja_JP">アセットタグを人気順に表示する:赤(高い)、黄色（普通)、緑（低い）</Description><Description language-id="pt_BR">Exibe marcadores coloridos por popularidade: vermelho (alta), amarelo (média) e verde (baixa).</Description><Description language-id="es_ES">Muestra las etiquetas de contenido coloreadas según su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id="sv_SE">Visar tillgångstaggar färgade efter popularitet: röd (hög), gul (medelhög) och grön (låg).</Description></root>',N'ftl',N'<#if entries?has_content>
	<ul class="tag-items tag-list">
		<#assign
			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())
			classNameId = getterUtil.getLong(classNameId, 0)

			maxCount = 1
			minCount = 1
		/>

		<#list entries as entry>
			<#assign
				maxCount = liferay.max(maxCount, entry.getAssetCount())
				minCount = liferay.min(minCount, entry.getAssetCount())
			/>
		</#list>

		<#assign multiplier = 1 />

		<#if maxCount != minCount>
			<#assign multiplier = 3 / (maxCount - minCount) />
		</#if>

		<#list entries as entry>
			<li class="taglib-asset-tags-summary">
				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />

				<#if popularity < 1>
					<#assign color = "green" />
				<#elseif (popularity >= 1) && (popularity < 2)>
					<#assign color = "orange" />
				<#else>
					<#assign color = "red" />
				</#if>

				<#assign tagURL = renderResponse.createRenderURL() />

				${tagURL.setParameter("resetCur", "true")}
				${tagURL.setParameter("tag", entry.getName())}

				<a class="tag" href="${tagURL}" style="color: ${color};">
					${entry.getName()}

					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>
						<span class="tag-asset-count">(${entry.getAssetCount()})</span>
					</#if>
				</a>
			</li>
		</#list>
	</ul>

	<br style="clear: both;" />
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57945,37631,37601,37607,NULL,'2021-04-25 05:43:40',27715,0,37765,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Basic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="nl_NL">Basis</Name><Name language-id="fi_FI">Perus</Name><Name language-id="fr_FR">Basique</Name><Name language-id="de_DE">Einfach</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="pt_BR">Básico</Name><Name language-id="es_ES">Básico</Name><Name language-id="sv_SE">Standard</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description></root>',N'ftl',N'<#assign count = 0
/>

<#if entries?has_content>
	<div class="row">
		<#list entries as curCPCatalogEntry>
			<#assign
				image = curCPCatalogEntry.getDefaultImageFileUrl()

				friendlyURL = cpContentHelper.getFriendlyURL(curCPCatalogEntry, themeDisplay)

				name = curCPCatalogEntry.getName()
			/>

			<div class="col-md-4">
				<div>
					<img src="${image}">
				</div>

				<div>
					<a href="${friendlyURL}">
						<strong>${name}</strong>
					</a>
				</div>
			</div>

			<#assign count = count + 1 />

			<#if count gte 3>
				</div>

				<div class="row">

				<#assign count = 0 />
			</#if>
		</#list>
	</div>
<#else>
	<div class="alert alert-info">
		<@liferay_ui["message"] key="no-products-were-found" />
	</div>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57946,37631,37601,37607,NULL,'2021-04-25 05:43:40',27707,0,37705,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Basic</Name><Name language-id="ar_SA">أساسي</Name><Name language-id="ca_ES">Bàsic</Name><Name language-id="zh_CN">基本的</Name><Name language-id="nl_NL">Basis</Name><Name language-id="fi_FI">Perus</Name><Name language-id="fr_FR">Basique</Name><Name language-id="de_DE">Einfach</Name><Name language-id="hu_HU">Egyszerű</Name><Name language-id="ja_JP">通常の検索に戻る</Name><Name language-id="pt_BR">Básico</Name><Name language-id="es_ES">Básico</Name><Name language-id="sv_SE">Standard</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id="ar_SA">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id="ca_ES">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id="zh_CN">简介显示博客的名字，作者和摘要。</Description><Description language-id="nl_NL">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description><Description language-id="fi_FI">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id="fr_FR">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id="de_DE">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id="hu_HU">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id="ja_JP">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id="pt_BR">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id="es_ES">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id="sv_SE">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description></root>',N'ftl',N'<#assign count = 0 />

<div class="container-fluid-1280" style="text-align:center">
	<div class="row" style="padding:15px">
		<#if entries?has_content>
			<#list entries as curCommerceAddress>
				<div class="col-md-4" style="text-align:left">
					<#assign
						editURL = commerceAddressDisplayContext.getEditCommerceAddressURL(curCommerceAddress.getCommerceAddressId())

						deleteURL = commerceAddressDisplayContext.getDeleteCommerceAddressURL(curCommerceAddress.getCommerceAddressId())

						editButtonValue = languageUtil.get(request, "edit")

						removeButtonValue = languageUtil.get(request, "remove")

						commerceCountry = curCommerceAddress.getCommerceCountry()
					/>

					<h2 style="color:#000"><strong>${curCommerceAddress.getName()}</strong></h2>

					<h3 style="color:#000">${curCommerceAddress.getStreet1()}</h3>

					<h3 style="color:#000">${curCommerceAddress.getZip()}, ${curCommerceAddress.getCity()}</h3>

					<#if commerceCountry??>
						<h3 style="color:#000">${commerceCountry.getName(themeDisplay.getLanguageId())}</h3>
					</#if>

					<div class="row" style="padding-top:30px">
						<@liferay_aui.button
							cssClass="btn-lg"
							href="${editURL}"
							name="editAddressButton"
							value="${editButtonValue}"
						/>

						<@liferay_aui.button
							cssClass="btn-lg"
							href="${deleteURL}"
							name="removeAddressButton"
							value="${removeButtonValue}"
						/>
					</div>
				</div>

				<#assign count = count + 1 />

				<#if count gte 3>
					</div>

					<div class="row" style="padding:15px">

					<#assign count = 0 />
				</#if>
			</#list>
		</#if>
	</div>

	<div class="row" style="padding:50px 0 15px 0">
		<#assign addButtonValue = languageUtil.get(request, "add-address") />

		<@liferay_aui.button
			cssClass="btn-lg btn-primary"
			href="${commerceAddressDisplayContext.getAddCommerceAddressURL()}"
			name="addAddressButton"
			value="${addButtonValue}"
		/>
	</div>
</div>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57947,37631,37601,37607,NULL,'2021-04-25 05:43:40',27705,0,37699,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Carousel</Name><Name language-id="ar_SA">مكتبة</Name><Name language-id="ca_ES">Carrussel</Name><Name language-id="zh_CN">Carousel</Name><Name language-id="nl_NL">Carrousel</Name><Name language-id="fi_FI">Karuselli</Name><Name language-id="fr_FR">Carrousel</Name><Name language-id="de_DE">Karussel</Name><Name language-id="hu_HU">Körhinta</Name><Name language-id="ja_JP">カルーセル</Name><Name language-id="pt_BR">Carrossel</Name><Name language-id="es_ES">Carrusel</Name><Name language-id="sv_SE">Carousel</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays images in a carousel.</Description><Description language-id="ar_SA">يعرض الصور في مكتبة.</Description><Description language-id="ca_ES">Mostra imatges en format carrusel.</Description><Description language-id="zh_CN">把图片显示在转盘中。</Description><Description language-id="nl_NL">Geeft afbeeldingen weer in een carrousel.</Description><Description language-id="fi_FI">Näyttää kuvat karusellissa.</Description><Description language-id="fr_FR">Affiche les images dans un carrousel.</Description><Description language-id="de_DE">Darstellung von Bildern in einem Karussell.</Description><Description language-id="hu_HU">Megjeleníti a képeket körhintaszerűen.</Description><Description language-id="ja_JP">カルーセル内に画像を表示</Description><Description language-id="pt_BR">Exibe imagens num carrossel.</Description><Description language-id="es_ES">Muestra imágenes en un carrusel.</Description><Description language-id="sv_SE">Visar bilder i carousel-format.</Description></root>',N'ftl',N'<#if entries?has_content>
	<style>
		#<@portlet.namespace />carousel .carousel-item {
			background-color: #000;
			height: 250px;
			overflow: hidden;
			text-align: center;
			width: 700px;
		}

		#<@portlet.namespace />carousel .carousel-item img {
			max-height: 250px;
			max-width: 700px;
		}
	</style>

	<div id="<@portlet.namespace />carousel">
		<#assign imageMimeTypes = propsUtil.getArray("dl.file.entry.preview.image.mime.types") />

		<#list entries as entry>
			<#if imageMimeTypes?seq_contains(entry.getMimeType())>
				<div class="carousel-item image-viewer-base-image">
					<img src="${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, "")}" />
				</div>
			</#if>
		</#list>
	</div>

	<@liferay_aui.script use="aui-carousel">
		var carousel = new A.Carousel(
			{
				after: {
					responsive: function(event) {
						event.stopImmediatePropagation();

						var boundingBox = event.currentTarget.get(''boundingBox'');

						boundingBox.all(''.image-viewer-base-image-list, .image-viewer-base-image'').setStyles(
							{
								height: ''auto'',
								maxHeight: event.height,
								maxWidth: event.width,
								width: ''auto''
							}
						);
					}
				},

				contentBox: ''#<@portlet.namespace />carousel'',
				height: 250,
				intervalTime: 2,
				width: 700
			}
		).render();
	</@liferay_aui.script>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57948,37631,37601,37607,NULL,'2021-04-25 05:43:40',27709,0,37717,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Navigation</Name><Name language-id="ar_SA">الملاحة</Name><Name language-id="ca_ES">Navegació</Name><Name language-id="zh_CN">导航</Name><Name language-id="nl_NL">Navigatie</Name><Name language-id="fi_FI">Navigointi</Name><Name language-id="fr_FR">Navigation</Name><Name language-id="de_DE">Navigation</Name><Name language-id="hu_HU">Navigáció</Name><Name language-id="ja_JP">ナビゲーション</Name><Name language-id="pt_BR">Navegação</Name><Name language-id="es_ES">Navegación</Name><Name language-id="sv_SE">Navigering</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id="ar_SA">يعرض موجزات RSS كشريط تنقل في اللوحة اليسرى. إذ يؤدي النقر فوق موجز إلى عرض قائمة بإدخالات الموجزات على اللوحة اليمنى.</Description><Description language-id="ca_ES">Mostra els canals RSS com una barra de navegació en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d''entrades en el tauler dret.</Description><Description language-id="zh_CN">在左侧面板上显示RSS源的导航栏。在右侧面板上点击Feed显示提要条目的列表。</Description><Description language-id="nl_NL">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description><Description language-id="fi_FI">Näyttää RSS-syötteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla syötettä näytetään syötteen arvot oikeassa paneelissa.</Description><Description language-id="fr_FR">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d''entrées de flux sur le panneau droit.</Description><Description language-id="de_DE">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeinträge im rechten Bereich dargestellt.</Description><Description language-id="hu_HU">Megjeleníti az RSS hírcsatornákat navigációs oszlopként a bal oldalon. Egy hírcsatornára kattintva megjeleníti a hírcsatorna bejegyzések listáját a jobb oldalon.</Description><Description language-id="ja_JP">RSSフィードを左のパネルにナビゲーションバーとして表示します。フィードをクリックすると、右パネルにフィードの内容がリスト表示されます</Description><Description language-id="pt_BR">Exibe os feeds RSS como uma barra de navegação no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id="es_ES">Muestra las fuentes RSS como una barra de navegación del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id="sv_SE">Visar RSS-flödet som ett navigeringsfält i panelen till vänster. Om du klickar på flödet visas en lista med feedposter i panelen till höger.</Description></root>',N'ftl',N'<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />

<style>
	.portlet-rss .feed-entry-content {
		margin-bottom: 20px;
		padding-left: 0;
	}
</style>

<#if entries?has_content>
	<#assign dateFormat = "dd MMM yyyy - HH:mm:ss" />

	<div class="container-fluid">
		<div class="row" id="<@portlet.namespace />feedsTab">
			<ul class="col-xs-4">
				<#list entries as curEntry>
					<li><a href="#tab-${curEntry_index}">${htmlUtil.escape(curEntry.getTitle())}</a></li>
				</#list>
			</ul>

			<div class="col-xs-8 tab-content">
				<#list entries as curEntry>
					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />

					<#if rssFeedEntries??>
						<div class="tab-pane" id="tab-${curEntry_index}">
							<#list rssFeedEntries as rssFeedEntry>
								<#if (rssFeedEntry_index > entriesPerFeed?number)>
									<#break>
								</#if>

								<#assign syndEntry = rssFeedEntry.getSyndEntry() />

								<div class="feed-entry-content">
									<div class="feed-title">
										<@liferay_aui["a"] href="${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}">${htmlUtil.escape(syndEntry.getTitle())}</@>
									</div>

									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>
										<div class="feed-entry-author">
											${htmlUtil.escape(syndEntry.getAuthor())}
										</div>
									</#if>

									<#if syndEntry.getPublishedDate()??>
										<div class="feed-date">
											<@liferay_ui["icon"]
												icon="calendar"
												label=true
												markupView="lexicon"
												message="${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}"
											/>
										</div>
									</#if>

									${rssFeedEntry.getSanitizedContent()}
								</div>
							</#list>
						</div>
					</#if>
				</#list>
			</div>
		</div>
	</div>

	<@liferay_aui["script"] use="aui-base,aui-tabview">
		new A.TabView(
			{
				srcNode: ''#<@portlet.namespace />feedsTab'',
				stacked: true,
				type: ''pills''
			}
		).render();
	</@>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57949,37631,37601,37607,NULL,'2021-04-25 05:43:40',27716,0,37768,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Icon</Name><Name language-id="ar_SA">أيقونة</Name><Name language-id="ca_ES">Icona</Name><Name language-id="zh_CN">图标</Name><Name language-id="nl_NL">Pictogram</Name><Name language-id="fi_FI">Kuvake</Name><Name language-id="fr_FR">Icône</Name><Name language-id="de_DE">Symbol</Name><Name language-id="hu_HU">Ikon</Name><Name language-id="ja_JP">アイコン</Name><Name language-id="pt_BR">Ícone</Name><Name language-id="es_ES">Icono</Name><Name language-id="sv_SE">Ikon</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays the icon of the flag associated with each language.</Description><Description language-id="ar_SA">يعرض أيقونة العلم المرتبط بكل لغة.</Description><Description language-id="ca_ES">Mostra la icona de la bandera associada a cada idioma.</Description><Description language-id="zh_CN">显示与每种语言关联的国旗的图标。</Description><Description language-id="nl_NL">Geeft het pictogram weer van de vlag die bij elke taal hoort.</Description><Description language-id="fi_FI">Näyttä kuhunkin kieleen liittyvän lippukuvakkeen.</Description><Description language-id="fr_FR">Affiche l''icône de chaque option associé à chaque langue.</Description><Description language-id="de_DE">Zeigt das Symbol der Flagge für jede Sprache an.</Description><Description language-id="hu_HU">Megjeleníti az egyes nyelvekhez társított zászlót tartalmazó ikont.</Description><Description language-id="ja_JP">各言語に関連付けられたフラグのアイコンを表示します</Description><Description language-id="pt_BR">Exibe o ícone do marcador associado com cada idioma.</Description><Description language-id="es_ES">Muestra el icono de la bandera asociada con cada idioma.</Description><Description language-id="sv_SE">Visar ikonen på flaggan som är associerad med varje språk.</Description></root>',N'ftl',N'<#if entries?has_content>
	<#list entries as entry>
		<#if entry.isSelected()>
			<#assign cssClass = "current-language" />
		</#if>

		<#if !entry.isDisabled()>
			<@liferay_aui["icon"]
				cssClass=cssClass
				image=entry.getW3cLanguageId()?lower_case
				markupView="lexicon"
				message=entry.getLongDisplayName()
				url=entry.getURL()
			/>
		</#if>
	</#list>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
	 (0,0,57950,37631,37601,37607,NULL,'2021-04-25 05:43:40',27716,0,37771,N'1.1',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Name language-id="en_US">Icon Menu</Name><Name language-id="ar_SA">قائمة أيقونات</Name><Name language-id="ca_ES">Menú d''icones</Name><Name language-id="zh_CN">图标菜单</Name><Name language-id="nl_NL">Pictogrammenu</Name><Name language-id="fi_FI">Kuvakevalikko</Name><Name language-id="fr_FR">Menu d''icônes</Name><Name language-id="de_DE">Symbolmenü</Name><Name language-id="hu_HU">Ikon menü</Name><Name language-id="ja_JP">アイコン メニュー</Name><Name language-id="pt_BR">Menu de ícones</Name><Name language-id="es_ES">Menú de icono</Name><Name language-id="sv_SE">Ikonmeny</Name></root>',N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="en_US">Displays an icon menu with the selected languages.</Description><Description language-id="ar_SA">يعرض قائمة الأيقونات باللغات المحددة.</Description><Description language-id="ca_ES">Mostra una icona de menú amb els idiomes seleccionats.</Description><Description language-id="zh_CN">显示带有选定语言的图标菜单。</Description><Description language-id="nl_NL">Geeft een pictogrammenu weer met de geselecteerde talen.</Description><Description language-id="fi_FI">Näyttää valittuihin kieliin liittyvän kuvakevalikon.</Description><Description language-id="fr_FR">Affiche un menu d''icônes avec les langues sélectionnées.</Description><Description language-id="de_DE">Zeigt ein Symbolmenü mit den ausgewählten Sprachen.</Description><Description language-id="hu_HU">Megjelenít egy ikonmenüt a kiválasztott nyelvekkel.</Description><Description language-id="ja_JP">選択した言語のアイコンメニューを表示します。</Description><Description language-id="pt_BR">Exibe um menu de ícone com os idiomas selecionados.</Description><Description language-id="es_ES">Muestra un menú de icono con los idiomas seleccionados.</Description><Description language-id="sv_SE">Visar en ikonmeny med de valda språken.</Description></root>',N'ftl',N'<#if entries?has_content>
	<#assign normalizedDefaultLanguageId = stringUtil.replace(languageId, "_", "-") />

	<div class="text-truncate">
		<@liferay_ui["icon-menu"]
			direction="left-side"
			icon=stringUtil.toLowerCase(normalizedDefaultLanguageId)
			markupView="lexicon"
			showWhenSingleIcon=true
			triggerLabel=normalizedDefaultLanguageId
			triggerType="button"
		>
			<#list entries as entry>
				<#if !entry.isSelected() && !entry.isDisabled()>
					<#assign
						entryLocale = entry.getLocale()
						displayName = stringUtil.toLowerCase(entryLocale.getDisplayLanguage(entryLocale)) + "-" + entryLocale.getDisplayCountry(entryLocale)
						normalizedDefaultLanguageId = stringUtil.toLowerCase(stringUtil.replace(entry.getLanguageId(), "_", "-"))
					/>

					<#if languageUtil.isBetaLocale(entryLocale)>
						<#assign displayName += " [beta]" />
					</#if>

					<@liferay_ui["icon"]
						icon=normalizedDefaultLanguageId
						iconCssClass="inline-item inline-item-before"
						markupView="lexicon"
						message=displayName
						url=entry.getURL()
					/>
				</#if>
			</#list>
		</@>
	</div>
</#if>',0,37607,NULL,'2021-04-25 05:43:40'),
