me completo de cada idioma (por exemplo, Espanhol).</Description><Description language-id="es_ES">Muestra el nombre completo de cada idioma (por ejemplo, español).</Description><Description language-id="sv_SE">Visar det fullständiga namnet på varje språk (t.ex. spanska).</Description></root>',N'ftl',N'<style>
