INSERT INTO Role_ (mvccVersion,ctCollectionId,uuid_,roleId,companyId,userId,userName,createDate,modifiedDate,classNameId,classPK,name,title,description,type_,subtype) VALUES
	 (0,0,N'2694623e-790b-453e-fa0b-74e383c99709',37619,37601,37607,NULL,'2021-04-25 05:43:33','2021-04-25 05:43:33',20064,37619,N'Site Member',NULL,N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US" default-locale="en_US"><Description language-id="en_US">All users who belong to a site have this role within that site.</Description></root>',2,NULL),
	 (0,0,N'37ad5caf-c134-7710-7892-ce073ffe803a',37620,37601,37607,NULL,'2021-04-25 05:43:33','2021-04-25 05:43:33',20064,37620,N'Site Owner',NULL,N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US" default-locale="en_US"><Description language-id="en_US">Site Owners are super users of their site and can assign site roles to users.</Description></root>',2,NULL),
	 (0,0,N'60e98274-7eeb-0ceb-330d-8283de7bf7d4',37644,37601,37607,NULL,'2021-04-25 05:43:36','2021-04-25 05:43:36',20064,37644,N'Asset Library Administrator',NULL,N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Administratörer av tillgångsbibliotek är superanvändare av sitt tillgångsbibliotek, men kan inte göra andra användare till administratörer i tillgångsbiblioteket.</Description><Description language-id="pt_BR">Os Administradores da Biblioteca de Ativos são super usuários da biblioteca de ativos, mas não podem tornar outros usuários Administradores da Biblioteca de Ativos.</Description><Description language-id="ja_JP">アセットライブラリの管理者はそれぞれのアセットライブラリのスーパーユーザーですが、他のユーザーをアセットライブラリの管理者にすることはできません。</Description><Description language-id="fr_FR">Les administrateurs d''un dépôt sont des super utilisateurs de leur dépôt, mais ne peuvent rendre administrateurs d''autres utilisateurs.</Description><Description language-id="hu_HU">Az adattár adminisztrátorai adattáruk magasabbrendű felhasználói, de nem nevezhetnek ki más felhasználókat az adattár adminisztrátoraivá.</Description><Description language-id="de_DE">Repository-Administratoren sind Administratoren ihres Repositorys, können aber andere Benutzer nicht zu Repository-Administratoren machen.</Description><Description language-id="ca_ES">Els administradors de la biblioteca de continguts són superusuaris de la seva biblioteca de continguts, però no poden assignar el rol d''administrador de biblioteca de continguts a altres usuaris.</Description><Description language-id="ar_SA">مسؤولو مكتبة الأصول هم مستخدمون متميزون لمكتبة الأصول الخاصة بهم ولكن لا يمكنهم تعيين مستخدمين آخرين كمسئولين لمكتبة الأصول.</Description><Description language-id="fi_FI">Sisältökirjaston Pääkäyttäjät ovat sisältökirjastonsa superkäyttäjiä, mutta eivät voi tehdä muista käyttäjistä Sisältökirjaston Pääkäyttäjiä.</Description><Description language-id="en_US">Asset Library Administrators are super users of their asset library but cannot make other users into Asset Library Administrators.</Description><Description language-id="zh_CN">资产库管理员是其资产库的超级用户，但不能使其他用户成为资产库管理员。</Description><Description language-id="es_ES">Los administradores del repositorio son superusuarios de su repositorio, pero no pueden convertir a otros usuarios en administradores del repositorio.</Description><Description language-id="nl_NL">Assetbibliotheekbeheerders zijn supergebruikers van hun assetbibliotheek, maar kunnen geen assetbibliotheekbeheerders maken van andere gebruikers.</Description></root>',5,NULL),
	 (0,0,N'ebb68ea3-e1fc-b01b-a289-480e26c14811',37645,37601,37607,NULL,'2021-04-25 05:43:36','2021-04-25 05:43:36',20064,37645,N'Asset Library Connected Site Member',NULL,NULL,5,NULL),
	 (0,0,N'c959cd95-21a6-78e2-53a4-45a838da8846',37646,37601,37607,NULL,'2021-04-25 05:43:36','2021-04-25 05:43:36',20064,37646,N'Asset Library Content Reviewer',NULL,NULL,5,NULL),
	 (0,0,N'a220c363-56af-c974-d5cc-da5ea782e958',37647,37601,37607,NULL,'2021-04-25 05:43:36','2021-04-25 05:43:36',20064,37647,N'Asset Library Member',NULL,N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Alla användare som tillhör ett tillgångsbibliotek har den här rollen i det tillgångsbiblioteket.</Description><Description language-id="pt_BR">Todos os usuários que pertencem a uma biblioteca de ativos possuem esta função nessa biblioteca de ativos.</Description><Description language-id="ja_JP">アセットライブラリに属している全ユーザーは、このアセットライブラリでこのロールを割り当てられています。</Description><Description language-id="fr_FR">Tous les utilisateurs qui appartiennent à un dépôt ont ce rôle au sein de ce dépôt.</Description><Description language-id="hu_HU">Egy adattárhoz tartozó összes felhasználó ezzel a szerepkörrel rendelkezik az adattáron belül.</Description><Description language-id="de_DE">Alle Benutzer, die zu einem Repository gehören, haben diese Rolle innerhalb dieses Repositorys inne.</Description><Description language-id="ca_ES">Tots els usuaris que pertanyin a una biblioteca de continguts tenen aquest rol en aquesta biblioteca de continguts.</Description><Description language-id="ar_SA">جميع المستخدمين الذين ينتمون إلى مكتبة أصول ما لديهم هذا الدور داخل مكتبة الأصول تلك.</Description><Description language-id="fi_FI">Kaikilla käyttäjillä, jotka kuuluvat sisältökirjastoon, on tämä rooli kyseisen sisältökirjaston sisällä.</Description><Description language-id="en_US">All users who belong to an asset library have this role within that asset library.</Description><Description language-id="zh_CN">属于资产库的所有用户都具有该资产库中的此角色。</Description><Description language-id="es_ES">Todos los usuarios que pertenecen a un repositorio tienen este rol en ese repositorio.</Description><Description language-id="nl_NL">Alle gebruikers die bij een assetbibliotheek horen, hebben deze rol in die assetbibliotheek.</Description></root>',5,NULL),
	 (0,0,N'c4c75e54-a05a-a774-24d7-ed341de0a0d6',37648,37601,37607,NULL,'2021-04-25 05:43:36','2021-04-25 05:43:36',20064,37648,N'Asset Library Owner',NULL,N'<?xml version=''1.0'' encoding=''UTF-8''?><root available-locales="en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL" default-locale="en_US"><Description language-id="sv_SE">Administratörer av tillgångsbibliotek är superanvändare av sitt tillgångsbibliotek och kan tilldela roller i tillgångsbiblioteket till användare.</Description><Description language-id="pt_BR">Os Proprietários de Bibliotecas de Ativo são super usuários de suas bibliotecas de ativo e podem atribuir funções da biblioteca de ativos a outros usuários.</Description><Description language-id="ja_JP">アセットライブラリの所有者は、それぞれのアセットライブラリのスーパーユーザーであり、ユーザーにアセットライブラリのロールを割り当てることができます。</Description><Description language-id="fr_FR">Les propriétaires d''un dépôt sont des super utilisateurs de ce dépôt et peuvent affecter des rôles à des utilisateurs.</Description><Description language-id="hu_HU">Az adattár tulajdonosai adattáruk magasabbrendű felhasználói, és adattár szerepköröket rendelhetnek hozzá más felhasználókhoz.</Description><Description language-id="de_DE">Besitzer von Repositorys sind Administratoren ihres Repositorys und können Benutzern Repository-Bibliotheksrollen zuweisen.</Description><Description language-id="ca_ES">Els propietaris de la biblioteca de continguts són superusuaris de la seva biblioteca de continguts, i poden assignar rols de la biblioteca de continguts als usuaris.</Description><Description language-id="ar_SA">مالكو مكتبة الأصول هم مستخدمون متميزون لمكتبة الأصول الخاصة بهم ويمكنهم تعيين أدوار مكتبة الأصول إلى المستخدمين.</Description><Description language-id="fi_FI">Sisältökirjaston Omistajat ovat sisältökirjastonsa superkäyttäjiä, ja voivat liittää sisältökirjaston rooleja käyttäjille.</Description><Description language-id="en_US">Asset Library Owners are super users of their asset library and can assign asset library roles to users.</Description><Description language-id="zh_CN">资产库所有者是其资产库的超级用户，且可以将资产库角色分配给用户。</Description><Description language-id="es_ES">Los propietarios de repositorio son superusuarios de su repositorio y pueden asignar roles de repositorio a otros usuarios.</Description><Description language-id="nl_NL">Assetbibliotheekeigenaars zijn supergebruikers van hun assetbibliotheek en kunnen assetbibliotheekrollen toewijzen aan gebruikers.</Description></root>',5,NULL),
